     "file_texts": "Theo khảo sát của PV Báo Lao Động ngày 28.11, lãi suất tiết kiệm kỳ hạn 12 tháng của BIDV đối với khách hàng cá nhân đang niêm yết ở mức 5,3%\/năm.Ngoài ra, đối với khách hàng cá nhân gửi tiết kiệm kỳ\nhạn 1 và 2 tháng, BIDV niêm yết lãi suất ở mức 3%\/năm. Tại các kỳ hạn 3 - 5 tháng, BIDV niêm yết lãi suất ở mức 3,3%\/năm.Lãi suất tiết kiệm tại BIDV các kỳ hạn từ 6 - 9 tháng ở mức 4,3%\/năm. Khách\nhàng gửi tiền từ 12 - 36 tháng nhận lãi suất cao nhất 5,3%\/năm. Khách hàng gửi tiền không kỳ hạn, sẽ nhận mức lãi suất ở mức 0,1%\/năm.Biểu lãi suất tiết kiệm dành cho ngân hàng cá nhân của BIDV. Ảnh\nchụp màn hình.Có 300 triệu VND gửi tiết kiệm 12 tháng nhận tối đa bao nhiêu tiềnBạn có thể tham khảo cách tính tiền lãi để biết số tiền lãi nhận được sau khi gửi tiết kiệm là bao nhiêu. Công thức tính\ntiền lãi như sau:Tiền lãi = Tiền gửi x lãi suất tiền gửi %\/12 x số tháng gửiVí dụ, bạn gửi 300 triệu đồng vào ngân hàng BIDV, kỳ hạn 12 tháng và hưởng lãi suất 5,3%\/năm, số tiền lãi nhận được như\nsau:300 triệu VND x 5,3%\/12 tháng x 12 tháng = 15,9 triệu VND.* Thông tin về lãi suất chỉ mang tính chất tham khảo và có thể thay đổi trong từng thời kỳ. Vui lòng liên hệ điểm giao dịch ngân hàng gần\nnhất hoặc hotline để được tư vấn cụ thể.Bạn đọc có thể tham khảo thêm các bài viết về lãi suất TẠI ĐÂY.",
