     "subject": "Tiền tệ đầu tư",
     "title": "Gửi 200 triệu đồng kỳ hạn 10 tháng tại Agribank nhận lãi suất bao nhiêu?",
     "author": "Tuyết Lan",
     "file_names": "10.txt",
     "file_texts": "Theo khảo sát của PV Báo Lao Động ngày 27.11, lãi suất tiết kiệm kỳ hạn 10 tháng của Agribank đối với khách hàng cá nhân đang niêm yết ở mức 4,3%\/năm.Ngoài ra, tại kỳ hạn 1 tháng và 2 tháng, Agribank\nniêm yết lãi suất ở mức 3%\/năm. Tại các kỳ hạn 3 - 5 tháng, Agribank niêm yết lãi suất ở mức là 3,3%\/năm. Lãi suất tiết kiệm tại Agribank các kỳ hạn từ 6 - 11 tháng ở mức 4,3%\/năm. Khách hàng gửi tiền\ntừ 12 - 24 tháng nhận lãi suất cao nhất 5,3%\/năm.Khách hàng gửi tiền không kỳ hạn và tiền gửi thanh toán sẽ nhận lãi suất ở mức 0,2%\/năm.Biểu lãi suất tiết kiệm Agribank ngày 27.11.2023. Ảnh chụp\nmàn hìnhBạn đọc có thể tính nhanh tiền lãi gửi ngân hàng qua công thức sau:Tiền lãi = Tiền gửi x lãi suất (%)\/12 tháng x số tháng gửiVí dụ, bạn gửi 200 triệu đồng vào Agribank, với lãi suất 4,3% ở kì\nhạn 10 tháng. Tiền lãi bạn nhận được ước tính bằng:Tiền lãi = 200 triệu đồng x 4,3%\/12 x 10 tháng = 7,16 triệu đồngTrước khi gửi tiết kiệm, bạn đọc nên so sánh lãi suất tiết kiệm giữa các ngân hàng,\nlãi suất giữa các kì hạn với nhau để được hưởng tiền lãi cao nhất.* Thông tin về lãi suất chỉ mang tính chất tham khảo và có thể thay đổi trong từng thời kỳ. Vui lòng liên hệ điểm giao dịch ngân hàng\ngần nhất hoặc hotline để được tư vấn cụ thể.Bạn đọc có thể tham khảo thêm các bài viết về lãi suất TẠI ĐÂY.",
     "token": "Theo_khảo_sát của PV_Báo_Lao_Động ngày 27.11 , lãi_suất tiết_kiệm kỳ_hạn 10 tháng của Agribank đối_với khách_hàng cá_nhân đang niêm_yết ở mức 4,3 % \/ năm . Ngoài_ra , tại kỳ_hạn 1 tháng và 2 tháng , Agribank niêm_yết lãi_suất ở mức 3 % \/ năm . Tại_các kỳ_hạn 3 - 5 tháng , Agribank niêm_yết lãi_suất ở mức là 3,3 % \/ năm . Lãi_suất tiết_kiệm tại Agribank các kỳ_hạn từ 6 - 11 tháng ở mức 4,3 % \/ năm . Khách_hàng gửi tiền từ 12 - 24 tháng nhận lãi_suất cao nhất 5,3 % \/ năm . Khách_hàng gửi tiền không kỳ_hạn và tiền gửi thanh_toán sẽ nhận lãi_suất ở mức 0,2 % \/ năm . Biểu lãi_suất tiết_kiệm Agribank ngày 27.11.2023 . Ảnh chụp màn hìnhBạn đọc có_thể tính nhanh tiền lãi gửi ngân_hàng qua công_thức sau : Tiền lãi = Tiền gửi x lãi_suất ( % ) \/ 12 tháng x số tháng gửiVí dụ , bạn gửi 200 triệu đồng vào Agribank , với lãi_suất 4,3 % ở kì_hạn 10 tháng . Tiền_lãi bạn nhận được ước_tính bằng : Tiền lãi = 200 triệu đồng x 4,3 % \/ 12 x 10 tháng = 7,16 triệu đồngTrước khi gửi tiết_kiệm , bạn_đọc nên so_sánh lãi_suất tiết_kiệm giữa các ngân_hàng , lãi_suất giữa các kì_hạn với nhau để được hưởng tiền lãi cao nhất . * Thông_tin về lãi_suất chỉ mang tính_chất tham_khảo và có_thể thay_đổi trong từng thời_kỳ . Vui_lòng liên_hệ điểm giao_dịch ngân_hàng gần nhất hoặc hotline để được tư_vấn cụ_thể . Bạn_đọc có_thể tham_khảo thêm các bài viết về lãi_suất TẠI_ĐÂY .",
