     "file_names": "100.txt",
     "file_texts": "Chủ tịch nước Võ Văn Thưởng và Phu nhân Phan Thị Thanh Tâm cùng đoàn đại biểu cấp cao Việt Nam đang có chuyến thăm chính thức Nhật Bản từ ngày 27 đến 30.11.2023 theo lời mời của Nhà nước Nhật\nBản.Trong khuôn khổ chuyến thăm chính thức Nhật Bản, ngày 27.11.2023, tại Phủ Thủ tướng Nhật Bản, Chủ tịch nước Võ Văn Thưởng và Phu nhân đã dự lễ đón chính thức, hội đàm, phát biểu báo chí chung và\ndự chiêu đãi trọng thể của Thủ tướng Nhật Bản Kishida Fumio và Phu nhân.Nhân dịp này, hai bên ra Tuyên bố chung về việc nâng cấp quan hệ Việt Nam - Nhật Bản lên \"Đối tác chiến lược toàn diện vì hoà\nbình và thịnh vượng tại châu Á và trên thế giới\".Sáng 28.11.2023, tại Thủ đô Tokyo, Chủ tịch nước Võ Văn Thưởng và Phu nhân Phan Thị Thanh Tâm hội kiến Nhà vua Nhật Bản Naruhito cùng Hoàng hậu\nMasako.Chủ tịch nước Võ Văn Thưởng hội kiến Nhà vua Nhật Bản Naruhito. Ảnh: TTXVNBà Phan Thị Thanh Tâm - Phu nhân Chủ tịch nước Võ Văn Thưởng, hội kiến Hoàng hậu Nhật Bản Masako. Ảnh: TTXVN",
