     "subject": "Tiền tệ đầu tư",
     "title": "So sánh lãi suất Agribank, Vietcombank và SCB: Gửi tiết kiệm 12 tháng ở đâu",
     "author": "Khương Duy",
     "file_names": "13.txt",
     "file_texts": "So sánh lãi suất 12 thángGhi nhận của PV Lao Động với ba ngân hàng Vietcombank, Agribank và SCB vào 12h30 ngày 27.11.2023, biểu lãi suất huy động kỳ hạn 12 tháng đang được niêm yết quanh ngưỡng\n5,0-5,45%\/năm. Trong đó:Vietcombank niêm yết lãi suất 12 tháng ở ngưỡng 5%\/năm. Đối với các kỳ hạn khác, Vietcombank niêm yết như sau: Lãi suất không kỳ hạn ở ngưỡng 0,1%\/năm; 1-2 tháng ở ngưỡng\n2,6%\/năm; 3-6-9 tháng ở ngưỡng 3,9%\/năm; các kỳ hạn từ 24 đến 60 tháng ở ngưỡng 5%\/năm.Vietcombank lưu ý trên website, lãi suất trên chỉ mang tính tham khảo và có thể thay đổi theo từng thời điểm. Lãi\nđược tính trên số ngày thực tế và cơ sở tính lãi là 365 ngày. Đáng chú ý, lãi suất các loại ngoại tệ khác hoặc các kỳ hạn không niêm yết, khách hàng có nhu cầu cần liên hệ trực tiếp với điểm giao dịch\nđể biết chi tiết.Cập nhật lãi suất Vietcombank ngày 27.11.2023. Ảnh chụp màn hìnhAgribank niêm yết lãi suất 12 tháng ở ngưỡng 5,3%\/năm.Đối với các kỳ hạn khác, Agribank niêm yết như sau: Lãi suất\nkhông kỳ hạn ở ngưỡng 0,2%\/năm; 1-2 tháng ở ngưỡng 3%\/năm; 3-4-5 tháng ở ngưỡng 3,3%\/năm; 6-7-8-9-10-11 tháng ở ngưỡng 4,3%\/năm; các kỳ hạn từ 13 đến 24 tháng ở ngưỡng 5,3%\/năm.Cập nhật lãi suất\nAgribank ngày 27.11.2023. Ảnh chụp màn hình.SCB niêm yết lãi suất 12 tháng cao nhất ở ngưỡng 5,45%\/năm (khi gửi tiết kiệm online và nhận lãi cuối kỳ).Đối với các kỳ hạn khác, SCB niêm yết như sau: Lãi\nsuất online không kỳ hạn ở ngưỡng 0,5%\/năm; 1 tháng ở ngưỡng 3,7%\/năm; 3 tháng ở ngưỡng 3,95%\/năm; 6 tháng ở ngưỡng 4,95%\/năm; các kỳ hạn từ 13 đến 36 tháng ở ngưỡng 5,45%\/năm.Cập nhật lãi suất SCB\nngày 27.11.2023. Ảnh chụp màn hình.Gửi tiết kiệm 500 triệu đồng nhận lãi ra sao?Để tính tiền lãi gửi tiết kiệm tại ngân hàng, bạn có thể áp dụng công thức:Tiền lãi = tiền gửi x lãi suất %\/12 x số\ntháng gửiVí dụ, bạn gửi 500 triệu đồng kỳ hạn 12 tháng tại Agribank với lãi suất 5,3%\/năm, bạn có thể nhận được: 500 triệu đồng x 5,3%\/12 x 12 = 26,5 triệu đồng.Cùng số tiền và kỳ hạn trên, nếu bạn\ngửi tiết kiệm tại Vietcombank có lãi suất 5% số tiền lãi bạn nhận được sẽ là: 500 triệu đồng x 5%\/12 x 12 = 25 triệu đồng.Trong khi đó, số tiền nhận được khi gửi tiết kiệm ở SCB như sau: 500 triệu\nđồng x 5,45%\/12 x 12 = 27,25 triệu đồng.* Thông tin về lãi suất chỉ mang tính chất tham khảo và có thể thay đổi trong từng thời kỳ. Vui lòng liên hệ điểm giao dịch ngân hàng gần nhất hoặc hotline để\nđược tư vấn cụ thể.Xem thêm các tin bài khác về lãi suất trên Báo Lao Động tại đây...",
     "token": "So_sánh lãi_suất 12 thángGhi nhận của PV Lao_Động với ba ngân_hàng Vietcombank , Agribank và SCB vào 12h30 ngày 27.11.2023 , biểu lãi_suất huy_động kỳ_hạn 12 tháng đang được niêm_yết quanh ngưỡng_5,0 - 5,45 % \/ năm . Trong_đó : Vietcombank niêm_yết lãi_suất 12 tháng ở ngưỡng 5 % \/ năm . Đối_với các kỳ_hạn khác , Vietcombank niêm_yết như sau : Lãi_suất không kỳ_hạn ở ngưỡng_0,1 % \/ năm ; 1 - 2 tháng ở ngưỡng_2,6 % \/ năm ; 3 - 6 - 9 tháng ở ngưỡng 3,9 % \/ năm ; các kỳ_hạn từ 24 đến 60 tháng ở ngưỡng 5 % \/ năm . Vietcombank lưu_ý trên website , lãi_suất trên chỉ mang tính tham_khảo và có_thể thay_đổi theo từng thời_điểm . Lãi được tính trên số ngày thực_tế và cơ_sở tính lãi là 365 ngày . Đáng chú_ý , lãi_suất các loại ngoại_tệ khác hoặc các kỳ_hạn không niêm_yết , khách_hàng có nhu_cầu cần liên_hệ trực_tiếp với điểm giao_dịch để biết chi_tiết . Cập_nhật lãi_suất Vietcombank ngày 27.11.2023 . Ảnh chụp màn hìnhAgribank niêm_yết lãi_suất 12 tháng ở ngưỡng_5,3 % \/ năm . Đối_với các kỳ_hạn khác , Agribank niêm_yết như sau : Lãi_suất không kỳ_hạn ở ngưỡng 0,2 % \/ năm ; 1 - 2 tháng ở ngưỡng 3 % \/ năm ; 3 - 4 - 5 tháng ở ngưỡng 3,3 % \/ năm ; 6 - 7 - 8 - 9 - 10 - 11 tháng ở ngưỡng 4,3 % \/ năm ; các kỳ_hạn từ 13 đến 24 tháng ở ngưỡng_5,3 % \/ năm . Cập_nhật lãi_suất Agribank ngày 27.11.2023 . Ảnh chụp màn_hình . SCB niêm_yết lãi_suất 12 tháng cao nhất ở ngưỡng_5,45 % \/ năm ( khi gửi tiết_kiệm online và nhận lãi cuối kỳ ) . Đối_với các kỳ_hạn khác , SCB niêm_yết như sau : Lãi_suất online không kỳ_hạn ở ngưỡng 0,5 % \/ năm ; 1 tháng ở ngưỡng 3,7 % \/ năm ; 3 tháng ở ngưỡng_3,95 % \/ năm ; 6 tháng ở ngưỡng_4,95 % \/ năm ; các kỳ_hạn từ 13 đến 36 tháng ở ngưỡng_5,45 % \/ năm . Cập_nhật lãi_suất SCB ngày 27.11.2023 . Ảnh chụp màn_hình . Gửi tiết_kiệm 500 triệu đồng nhận lãi ra sao ? Để_tính tiền lãi gửi tiết_kiệm tại ngân_hàng , bạn có_thể áp_dụng công_thức : Tiền_lãi = tiền gửi x lãi_suất % \/ 12 x số tháng gửiVí dụ , bạn_gửi 500 triệu đồng kỳ_hạn 12 tháng tại Agribank với lãi_suất 5,3 % \/ năm , bạn có_thể nhận được : 500 triệu đồng x 5,3 % \/ 12 x 12 = 26,5 triệu đồng . Cùng_số tiền và kỳ_hạn trên , nếu bạn gửi tiết_kiệm tại Vietcombank có lãi_suất 5 % số tiền lãi bạn nhận được sẽ là : 500 triệu đồng x 5 % \/ 12 x 12 = 25 triệu đồng . Trong khi đó , số tiền nhận được khi gửi tiết_kiệm ở SCB như sau : 500 triệu đồng x 5,45 % \/ 12 x 12 = 27,25 triệu đồng . * Thông_tin về lãi_suất chỉ mang tính_chất tham_khảo và có_thể thay_đổi trong từng thời_kỳ . Vui_lòng liên_hệ điểm giao_dịch ngân_hàng gần nhất hoặc hotline để được tư_vấn cụ_thể . Xem thêm các tin bài khác về lãi_suất trên Báo_Lao_Động tại đây ...",
