     "file_texts": "Tuần vừa qua, VN-Index giảm điểm sau tín hiệu chững lại trong tuần trước và vẫn đang trong quá trình kiểm định lại ngưỡng hỗ trợ 1.100 điểm.Đáng chú ý, trong thời gian gần đây, thị trường thường thay\nđổi đột ngột trong những phút cuối, đặc biệt là trong phiên ATC và gây bất ngờ đến với nhà đầu tư khi nhà đầu tư không thể chủ động được trong phiên ATC.Trong lịch sử, các đợt biến động mạnh trong\nphiên ATC thường hay đến từ các quỹ ETF trong các đợt cơ cấu danh mục theo quý. Nhìn chung, các hiện tượng này xảy ra nhiều lần cũng sẽ khiến các nhà đầu tư thận trọng hơn trong việc giao dịch và từ\nđó dễ dẫn đến thanh khoản của thị trường ở mức thấp trong những phiên sau đó.Nhìn lại đợt tăng từ đầu tháng 11, diễn biến chỉ số VN30 ghi nhận mức tăng yếu hơn đáng kể so với các chỉ số VN-Midcap và\nVN-Smallcap, cho thấy dòng tiền chủ yếu tập trung vào nhóm cổ phiếu vừa và nhỏ.Tuy vậy, dòng tiền này chủ yếu đến từ sự dịch chuyển khẩu vị đầu tư từ các kênh đầu tư khác có tỉ suất sinh lời thấp hơn\nkênh chứng khoán nên có tính đầu cơ khá cao, khiến thị trường liên tục xuất hiện những phiên giao dịch có biến động rất mạnh.Tình trạng “xanh vỏ đỏ lòng” gần đây cũng cho thấy, dòng tiền đã dần quay\nlại với nhóm VN30, đồng thời cho thấy, sự thay đổi khẩu vị rủi ro của dòng tiền mới đổ vào thị trường chứng khoán. Sự thay đổi này mang yếu tố tích cực nhiều hơn khi nhóm VN30 tập hợp các cổ phiếu đã\nđáp ứng nhiều tiêu chuẩn khắt khe, do vậy có thể mang lại mức sinh lời bền vững trong dài hạn.Theo phân tích của các chuyên gia Công ty Chứng khoán Rồng Việt, trong phiên cuối tuần trước, mặc dù có\ntrạng thái quá bán ngắn hạn dưới vùng 1.080 điểm, nhưng thị trường vẫn có diễn biến hồi phục trở lại.Thanh khoản giảm so với phiên trước, nhưng vẫn ở mức khá cao, cho thấy có trạng thái tranh chấp\ncung cầu. Dòng tiền có nỗ lực hỗ trợ tại vùng giá thấp trong phiên, nhưng nhìn chung, nhịp hồi phục hiện tại có thể chỉ mang tính chất kỹ thuật khi phản ứng với vùng hỗ trợ 1.080 điểm sau nhịp giảm\nnhanh.Dự kiến thị trường sẽ có diễn biến thận trọng tại vùng 1.095-1.100 điểm và tín hiệu sụt giảm mạnh gần đây vẫn có thể sẽ ảnh hưởng không tốt đến thị trường trong thời gian tới.Các chuyên gia của\nCông ty Chứng khoán VietCap dự báo, trong phiên tới, thị trường có thể sẽ duy trì quán tính hồi phục để chỉ số VN-Index kiểm định lại các kháng cự MA5 tại 1.100 điểm và MA10 tại 1.105 điểm.Nếu lực mua\nở vùng giá cao tiếp tục được cải thiện, VN-Index sẽ tiếp tục kiểm định kháng cự quan trọng hơn là vùng 1.118 điểm của cặp MA50 và MA200 ngày.Ngược lại, nếu lực mua thể hiện xung lực yếu ở vùng giá\ncao, VN-Index sẽ thoái lui từ kháng cự 1.100-1.105 điểm để kiểm định lại hỗ trợ MA20 tại 1.085 điểm.",
     "token": "Tuần_vừa_qua , VN - Index_giảm điểm sau tín_hiệu chững lại trong tuần trước và vẫn đang trong quá_trình kiểm_định lại ngưỡng hỗ_trợ 1.100 điểm . Đáng chú_ý , trong thời_gian gần đây , thị_trường thường thay_đổi đột_ngột trong những phút cuối , đặc_biệt là trong phiên_ATC và gây bất_ngờ đến với nhà_đầu_tư khi nhà_đầu_tư không_thể chủ_động được trong phiên ATC._Trong_lịch_sử , các đợt biến_động mạnh trong phiên ATC_thường hay đến từ các quỹ ETF trong các đợt cơ_cấu danh_mục theo quý . Nhìn_chung , các hiện_tượng này xảy ra nhiều lần cũng sẽ khiến các nhà_đầu_tư thận_trọng hơn trong việc giao_dịch và từ đó dễ dẫn đến thanh_khoản của thị_trường ở mức thấp trong những phiên sau đó . Nhìn lại đợt tăng từ đầu tháng 11 , diễn_biến chỉ số VN30 ghi nhận mức tăng yếu hơn đáng_kể so với các chỉ_số_VN - Midcap và VN - Smallcap , cho thấy dòng tiền chủ_yếu tập_trung vào nhóm cổ_phiếu vừa và nhỏ . Tuy_vậy , dòng tiền này chủ_yếu đến từ sự dịch_chuyển khẩu_vị đầu_tư từ các kênh đầu_tư khác có tỉ_suất sinh lời thấp hơn kênh chứng_khoán nên có tính đầu_cơ khá cao , khiến thị_trường liên_tục xuất_hiện những phiên giao_dịch có biến_động rất mạnh . Tình_trạng “ xanh vỏ đỏ lòng ” gần đây cũng cho thấy , dòng tiền đã dần quay lại với nhóm VN30 , đồng_thời cho thấy , sự thay_đổi khẩu_vị rủi_ro của dòng tiền mới đổ vào thị_trường_chứng_khoán . Sự thay_đổi này mang yếu_tố tích_cực nhiều hơn khi nhóm VN30 tập_hợp các cổ_phiếu đã đáp_ứng nhiều tiêu_chuẩn khắt_khe , do_vậy có_thể mang lại mức sinh_lời bền_vững trong dài_hạn . Theo_phân_tích của các chuyên_gia Công_ty Chứng_khoán Rồng_Việt , trong phiên cuối tuần trước , mặc_dù có trạng_thái quá bán_ngắn_hạn dưới vùng 1.080_điểm , nhưng thị_trường vẫn có diễn_biến hồi_phục trở_lại . Thanh_khoản giảm so với phiên trước , nhưng vẫn ở mức khá cao , cho thấy có trạng_thái tranh_chấp cung_cầu . Dòng_tiền có nỗ_lực hỗ_trợ tại vùng giá thấp trong phiên , nhưng nhìn_chung , nhịp hồi_phục hiện_tại có_thể chỉ mang tính_chất kỹ_thuật khi phản_ứng với vùng hỗ_trợ 1.080_điểm sau nhịp giảm nhanh . Dự_kiến thị_trường sẽ có diễn_biến thận_trọng tại vùng_1.095 - 1.100 điểm và tín_hiệu sụt_giảm mạnh gần đây vẫn có_thể sẽ ảnh_hưởng không tốt đến thị_trường trong thời_gian tới . Các chuyên_gia của Công_ty Chứng_khoán VietCap dự_báo , trong phiên tới , thị_trường có_thể sẽ duy_trì quán_tính hồi_phục để chỉ số VN - Index kiểm_định lại các kháng_cự MA5 tại 1.100_điểm và MA10 tại 1.105_điểm . Nếu_lực mua ở vùng giá cao tiếp_tục được cải_thiện , VN - Index sẽ tiếp_tục kiểm_định kháng_cự quan_trọng hơn là vùng 1.118_điểm của cặp MA50 và MA200 ngày . Ngược_lại , nếu lực mua thể_hiện xung_lực yếu ở vùng giá cao , VN - Index sẽ thoái lui từ kháng_cự 1.100 - 1.105_điểm để kiểm_định lại hỗ_trợ MA20 tại 1.085_điểm .",
