     "file_texts": "Giá vàng trong nước mở cửa phiên giao dịch hôm nay được Tập đoàn DOJI niêm yết chiều mua vào ở ngưỡng 71,7 triệu đồng\/lượng; giá bán ra là 72,7 triệu đồng\/lượng.Chênh lệch giá mua - bán vàng tại DOJI\nlà 1 triệu đồng\/lượng.So với mở phiên giao dịch hôm qua, giá vàng tại DOJI tăng 450.000 đồng\/lượng chiều mua vào và tăng 400.000 đồng\/lượng chiều bán ra.Trong khi đó, Công ty VBĐQ Sài Gòn SJC niêm\nyết, giá vàng mua vào 72,0 triệu đồng\/lượng; giá bán ra là 72,8 triệu đồng\/lượng.Chênh lệch giá mua - bán vàng tại Công ty VBĐQ Sài Gòn SJC là 800.000 đồng\/lượng.So với mở cửa phiên hôm qua, giá vàng\ntại Công ty VBĐQ Sài Gòn SJC tăng 600.000 đồng\/lượng chiều mua vào và tăng 500.000 đồng\/lượng chiều bán ra.Chênh lệch mua - bán vàng SJC đang được các đơn vị kinh doanh nới rộng. Điều này khiến nhà\nđầu tư đối diện nguy cơ thua lỗ cao hơn.Diễn biến vàng thế giới. Nguồn: KitcoGiá vàng thế giới tính đến 9h00' hôm nay, niêm yết trên Kitco ở mức 2.015,3 USD\/ounce. So với mở cửa phiên giao dịch trước,\ngiá vàng thế giới tăng 5,7 USD\/ounce.Vàng liên tục tăng giá trong vài tuần qua, sau khi Cục Dự trữ Liên bang Mỹ (FED) phát đi tín hiệu ngừng chu kỳ tăng lãi suất trong cuộc họp tháng 11 và những tháng\ntới và có thể bắt đầu chu kỳ giảm lãi suất từ giữa năm 2024. Việc FED dừng tăng lãi suất cho thấy, chính sách tiền tệ của nước này đã bắt đầu chuyển sang nới lỏng hơn, chỉ số đồng USD (DXY) lao dốc\nmạnh giúp giá vàng hưởng lợi.Trong khi đó, nhu cầu về vàng trang sức dịp cuối năm cũng tăng cao ở một số nước cũng hỗ trợ giá vàng. Ngoài ra, nhu cầu mua vào vàng của ngân hàng trung ương các nước\ncũng giúp giá kim loại quý đi lên. Tính đến quý III\/2023, ngân hàng trung ương các nước đã mua vào khoảng 800 tấn và có thể vượt 1.000 tấn trong năm nay. Trong đó, riêng Trung Quốc đã đều đặn mua vào\nvàng hằng tháng, ước tính quốc gia này đã mua vào khoảng 170 tấn vàng trong 3 quý đầu năm.Nhà phân tích thị trường cao cấp Craig Erlam tại OANDA cho rằng, vàng đang tăng vượt mức 2.000 USD\/ounce một\ncách ngoạn mục sau báo cáo được công bố tuần trước nữa cho thấy lạm phát và thị trường việc làm đang hạ nhiệt.Trong một ghi chú được công bố gần đây, các nhà phân tích hàng hóa tại Goldman Sachs cho\nhay, họ kỳ vọng giá vàng sẽ cao hơn trong năm 2024 và nâng mục tiêu giá trong 12 tháng lên 2.050 USD\/ounce. Động lực để vàng tăng giá vẫn là sức mua mạnh từ người tiêu dùng Trung Quốc, Ấn Độ và các\nngân hàng trung ương.Các nhà đầu tư đang chờ đợi số liệu GDP quý 3 sửa đổi của Mỹ sẽ được công bố vào vào thứ 4 và chỉ số giá tiêu dùng cốt lõi, thước đo lạm phát ưa thích của Cục Dự trữ Liên bang Mỹ\n(Fed) vào thứ Năm.Theo chuyên gia phân tích thị trường tài chính Kyle Rodda của Capital.com, các số liệu kinh tế được công bố trong tuần này sẽ quyết định liệu vàng có duy trì trên 2.000 USD\/ounce hay\nkhông.Xem thêm các tin bài khác về giá vàng trên Báo Lao Động tại đây...",
