     "file_texts": "Các nhà khoa học cho biết, một tảng băng trôi có diện tích gần gấp ba lần diện tích của Thành phố New York (Mỹ) đã tách ra khỏi đáy đại dương và bắt đầu trôi về phía bắc tới cái gọi là “hẻm băng\ntrôi”.Tảng băng trôi có tên A23a là tảng băng lớn nhất thế giới với diện tích khổng lồ 4.000 km2. Nó tách khỏi bờ biển Nam Cực vào năm 1986 nhưng nhanh chóng nằm ở biển Weddell, biến khu vực này thành\nmột hòn đảo băng khổng lồ.Tuy nhiên, sau khi ở lại đây khoảng 37 năm, các nhà khoa học đã xác nhận hôm 24.11 rằng, hình ảnh vệ tinh cho thấy, khối băng nặng hàng nghìn tỉ tấn đang trôi về phía bắc qua\nbán đảo Nam Cực, được hỗ trợ bởi gió mạnh và dòng hải lưu.Một tảng băng trôi có kích thước như thế đang di chuyển là cảnh tượng hiếm thấy đối với các nhà nghiên cứu sông băng.“Theo thời gian, nó có lẽ\nchỉ mỏng đi một chút và có thêm một chút sức nổi để nổi lên khỏi đáy đại dương và bị dòng hải lưu đẩy đi” - Reuters dẫn lời Oliver Marsh thuộc Cơ quan Khảo sát Nam Cực của Anh cho hay.Tại sao tảng\nbăng lâu đời nhất trên hành tinh lại tách ra và trôi dạt cho đến nay vẫn còn là một bí ẩn.Tiến sĩ Andrew Fleming, đồng nghiệp của Marsh, nói với BBC, tảng băng tách ra từ năm 1986 và cuối cùng đã giảm\nkích thước đủ để mất độ bám và bắt đầu di chuyển. Tiến sĩ Fleming cho biết, từ năm 2020, ông đã ghi nhận những dấu hiệu nhận biết về việc băng sẽ trôi.Giống như hầu hết tảng băng trôi trong khu vực,\nA23a rất có thể sẽ di chuyển vào dòng hải lưu Nam Cực, từ đó sẽ đưa nó tới “hẻm băng trôi” - nơi một số tảng băng trôi tương tự tụ tập trong vùng nước tối - chẳng hạn như tảng băng trôi đã va chạm vào\nnăm 1912 với tàu Titanic khiến tàu bị chìm, làm 1.517 người thiệt mạng.Tảng băng trôi A23a là tảng băng lớn nhất thế giới với diện tích 4.000 km2. Ảnh: TS2.spaceTuy nhiên, các nhà khoa học lo ngại\nrằng, tảng băng trôi khổng lồ một lần nữa có thể rơi xuống đảo Nam Georgia ở Nam Đại Tây Dương, có khả năng tàn phá động vật hoang dã ở Nam Cực bằng cách cắt đứt khả năng tiếp cận của hàng triệu hải\ncẩu, chim cánh cụt và chim biển sử dụng khu vực này để sinh sản hoặc săn bắt đồ ăn.Giống như tất cả tảng băng trôi, số phận cuối cùng của A23a sẽ khiến nó tan biến thành hư vô - nhưng một tảng băng\nkhổng lồ như thế này có thể mất nhiều thời gian để làm được điều đó, có khả năng khiến nhiều người đau đầu hơn sau này.Marsh nói với Reuters: “Một tảng băng trôi với quy mô như thế này có khả năng tồn\ntại khá lâu ở Nam Đại Dương mặc dù nó ấm hơn nhiều. Nó có thể di chuyển xa hơn về phía bắc tới Nam Phi, làm gián đoạn hoạt động vận chuyển”.",
     "token": "Các nhà_khoa_học cho biết , một tảng băng trôi có diện_tích gần gấp ba lần diện_tích của Thành_phố New_York ( Mỹ ) đã tách ra khỏi đáy đại_dương và bắt_đầu trôi về phía bắc tới cái gọi là “ hẻm băng trôi ” . Tảng băng trôi có tên A23a là tảng băng lớn nhất thế_giới với diện_tích khổng_lồ 4.000 km2 . Nó tách khỏi bờ biển Nam_Cực vào năm 1986 nhưng nhanh_chóng nằm ở biển Weddell , biến khu_vực này thành một hòn đảo băng khổng_lồ . Tuy_nhiên , sau khi ở lại đây khoảng 37 năm , các nhà_khoa_học đã xác_nhận hôm 24.11 rằng , hình_ảnh vệ_tinh cho thấy , khối băng nặng_hàng nghìn_tỉ tấn đang trôi về phía bắc qua bán_đảo Nam_Cực , được hỗ_trợ bởi gió mạnh và dòng hải_lưu . Một_tảng băng trôi có kích_thước như_thế đang di_chuyển là cảnh_tượng hiếm thấy đối_với các nhà_nghiên_cứu sông_băng . “_Theo thời_gian , nó có_lẽ chỉ mỏng đi một_chút và có thêm một_chút sức nổi để nổi lên khỏi đáy đại_dương và bị dòng hải lưu_đẩy đi ” - Reuters_dẫn lời Oliver_Marsh thuộc Cơ_quan Khảo_sát Nam_Cực của Anh_cho_hay . Tại_sao tảng băng lâu_đời nhất trên hành_tinh lại tách ra và trôi_dạt cho đến nay vẫn còn là một bí_ẩn . Tiến_sĩ Andrew_Fleming , đồng_nghiệp của Marsh , nói với BBC , tảng băng tách ra từ năm 1986 và cuối_cùng đã giảm kích_thước đủ để mất độ bám và bắt_đầu di_chuyển . Tiến_sĩ Fleming cho biết , từ năm 2020 , ông đã ghi_nhận những dấu_hiệu nhận_biết về việc băng sẽ trôi . Giống_như hầu_hết tảng băng trôi trong khu_vực , A23a rất có_thể sẽ di_chuyển vào dòng hải lưu Nam_Cực , từ đó sẽ đưa nó tới “ hẻm băng trôi ” - nơi một_số tảng băng trôi tương_tự tụ_tập trong vùng nước tối - chẳng_hạn như tảng băng trôi đã va_chạm vào năm 1912 với tàu Titanic khiến tàu bị chìm , làm 1.517 người thiệt_mạng . Tảng băng trôi A23a là tảng băng lớn nhất thế_giới với diện_tích 4.000 km2 . Ảnh : TS2 . spaceTuy_nhiên , các nhà_khoa_học lo_ngại rằng , tảng băng trôi khổng_lồ một lần nữa có_thể rơi xuống đảo Nam_Georgia ở Nam_Đại_Tây_Dương , có khả_năng tàn_phá động_vật hoang_dã ở Nam_Cực bằng cách cắt đứt khả_năng tiếp_cận của hàng triệu hải cẩu , chim_cánh cụt và chim_biển sử_dụng khu_vực này để sinh_sản hoặc săn_bắt đồ_ăn . Giống_như tất_cả tảng băng trôi , số_phận cuối_cùng của A23a sẽ khiến nó tan biến thành hư vô - nhưng một tảng băng khổng_lồ như thế_này có_thể mất nhiều thời_gian để làm được điều đó , có khả_năng khiến nhiều người đau_đầu hơn sau_này . Marsh nói với Reuters : “_Một tảng băng trôi với quy_mô như thế_này có khả_năng tồn_tại khá lâu ở Nam_Đại_Dương mặc_dù nó ấm hơn nhiều . Nó có_thể di_chuyển xa hơn về phía bắc tới Nam_Phi , làm gián_đoạn hoạt_động vận_chuyển ” .",
