     "file_texts": "Thục phi Văn Tú (1909-1953) sinh ra trong một gia đình dòng dõi lâu đời nhưng gia cảnh nghèo khó. Bà học giỏi và được chọn làm vợ thứ 2 của Hoàng đế Phổ Nghi năm bà 13 tuổi. Bà được phong làm thục\nphi, tước hiệu chỉ thấp hơn Hoàng hậu Uyển Dung.Theo SCMP, Hoàng đế Phổ Nghi thích ở bên cạnh Hoàng hậu Uyển Dung hơn nên Thục phi Văn Tú thường dành cả ngày để đọc sách, nghiên cứu hoặc dạy các cung\nnữ đọc và viết.Hoàn cảnh của Thục phi Văn Tú cũng không thay đổi nhiều sau khi các thành viên hoàng gia phải rời khỏi Tử Cấm Thành năm 1924.Trong biệt thự thuê ở Thiên Tân, Hoàng đế Phổ Nghi và Hoàng\nhậu Uyển Dung chung sống ở tầng 1 trong khi Thục phi chung sống cùng tầng với người hầu.Hoàng đế Phổ Nghi vẫn phớt lờ Thục phi Văn Tú ngay cả khi bà tìm cách thu hút sự chú ý của ông bằng cách tự\ntử.Tới tháng 8.1931, Thục phi Văn Tú quyết định ra đi. Thông qua luật sư của mình, bà gửi giấy ly hôn Hoàng đế Phổ Nghi. Sau nhiều tuần, Hoàng đế Phổ Nghi đồng ý ly hôn và thủ tục hoàn tất vào tháng\n10 cùng năm.Sau khi ly hôn, Thục phi Văn Tú đổi tên và tiếp tục cuộc sống bình thường. Bà trở thành giáo viên dạy tiếng Trung và hội họa truyền thống Trung Quốc tại một trường học ở Bắc Kinh.Thục phi\nVăn Tú qua đời ở tuổi 44 vì đau tim. Ảnh chụp màn hìnhTuy nhiên, việc bà bị loại khỏi vai trò cựu phi tần của hoàng đế cuối cùng của nhà Thanh đã thu hút sự chú ý của báo giới, nhiều phóng viên tìm\nđến trường và bà buộc phải nghỉ việc.Bà đã thay đổi nơi ở nhiều lần vì mọi người luôn nhận ra bà là cựu phi tần của hoàng đế. Cuối cùng, khi cạn tiền, bà thậm chí còn phải bán thuốc lá trên đường phố\nđể mưu sinh.Năm 1947, bà tìm được việc làm biên tập viên cho tờ báo tiếng Trung North China Daily. Ít lâu sau, bà kết hôn với một doanh nhân, họ hàng của chủ tờ báo, và trở thành bà nội trợ.Năm 1949,\nVăn Tú và chồng không rời Bắc Kinh. Trước những biến động của thời cuộc, chồng bà được giao làm công việc quét dọn. Cặp đôi sống lặng lẽ trong hoàn cảnh rất khiêm tốn.Ngày 17.9.1953, Thục phi Văn Tú,\n44 tuổi, qua đời tại nhà vì đau tim. Đồng nghiệp của chồng bà đã làm một chiếc quan tài thô sơ bằng gỗ và chôn cất cựu phi tần của vị hoàng đế cuối cùng của Trung Quốc trong ngôi mộ của một người\nnghèo cách Tử Cấm Thành vài km về phía bắc.",
     "token": "Thục_phi Văn_Tú ( 1909 - 1953 ) sinh ra trong một gia_đình dòng_dõi lâu_đời nhưng gia_cảnh nghèo_khó . Bà_học giỏi và được chọn làm vợ thứ 2 của Hoàng_đế Phổ_Nghi năm bà 13 tuổi . Bà được phong làm thục phi , tước_hiệu chỉ thấp hơn Hoàng_hậu Uyển_Dung . Theo_SCMP , Hoàng_đế Phổ_Nghi thích ở bên cạnh Hoàng_hậu Uyển_Dung hơn_nên Thục_phi Văn_Tú thường dành cả ngày để đọc sách , nghiên_cứu hoặc dạy các cung_nữ đọc và viết . Hoàn_cảnh của Thục_phi Văn_Tú cũng không thay_đổi nhiều sau khi các thành_viên hoàng_gia phải rời khỏi Tử_Cấm_Thành năm 1924 . Trong_biệt_thự thuê ở Thiên_Tân , Hoàng_đế Phổ_Nghi và Hoàng_hậu Uyển_Dung chung sống ở tầng 1 trong khi Thục_phi chung sống cùng tầng với người hầu_. Hoàng_đế Phổ_Nghi vẫn phớt_lờ Thục phi Văn_Tú ngay cả khi bà tìm cách thu_hút sự chú_ý của ông bằng cách tự_tử . Tới tháng 8.1931 , Thục_phi Văn_Tú quyết_định ra đi . Thông_qua luật_sư của mình , bà gửi giấy ly_hôn Hoàng_đế Phổ_Nghi . Sau_nhiều tuần , Hoàng_đế Phổ_Nghi đồng_ý ly_hôn và thủ_tục hoàn_tất vào tháng 10 cùng năm . Sau_khi ly_hôn , Thục_phi Văn_Tú đổi tên và tiếp_tục cuộc_sống bình_thường . Bà_trở thành giáo_viên dạy tiếng Trung và hội_họa truyền_thống Trung_Quốc tại một trường_học ở Bắc_Kinh . Thục_phi Văn_Tú qua_đời ở tuổi 44 vì đau tim . Ảnh chụp màn hìnhTuy_nhiên , việc bà bị loại khỏi vai_trò cựu phi_tần của hoàng_đế cuối_cùng của nhà_Thanh đã thu_hút sự chú_ý của báo_giới , nhiều phóng_viên tìm đến trường và bà buộc phải nghỉ_việc . Bà đã thay_đổi nơi ở nhiều lần vì mọi người luôn nhận ra bà là cựu phi_tần của hoàng_đế . Cuối_cùng , khi cạn tiền , bà thậm_chí còn phải bán thuốc_lá trên đường_phố để mưu_sinh . Năm_1947 , bà tìm được việc_làm biên_tập_viên cho tờ báo tiếng Trung_North China_Daily . Ít_lâu_sau , bà kết_hôn với một doanh_nhân , họ_hàng của chủ tờ báo , và trở_thành bà nội_trợ . Năm_1949 , Văn_Tú và chồng không rời Bắc_Kinh . Trước_những biến_động của thời_cuộc , chồng bà được giao làm công_việc quét_dọn . Cặp_đôi_sống lặng_lẽ trong hoàn_cảnh rất khiêm_tốn . Ngày_17.9.1953 , Thục_phi Văn_Tú , 44 tuổi , qua_đời tại nhà vì đau tim . Đồng_nghiệp của chồng bà đã làm một chiếc quan_tài thô_sơ bằng gỗ và chôn_cất cựu phi_tần của vị hoàng_đế cuối_cùng của Trung_Quốc trong ngôi mộ của một người nghèo cách Tử_Cấm_Thành vài km về phía bắc .",
