     "Column1": 30,
     "subject": "Tư Liệu",
     "title": "Bùng nổ thương mại APEC sau hành trình 34 năm",
     "author": "Khánh Minh",
     "file_names": "36.txt",
     "file_texts": "APEC đóng góp khoảng 59% GDP toàn cầu APEC được thành lập vào ngày 6.11.1989 tại Canberra (Australia) với tư cách là một diễn đàn kinh tế mở, nhằm xúc tiến các biện pháp kinh tế, thúc đẩy thương mại và\nđầu tư giữa các nền kinh tế thành viên trên cơ sở hoàn toàn tự nguyện, trong khi thực sự mở cửa đối với tất cả các nước và khu vực khác.12 thành viên sáng lập APEC là Mỹ, Nhật Bản, Australia, New\nZealand, Canada, Hàn Quốc, Thái Lan, Philippines, Singapore, Brunei, Indonesia và Malaysia.Tháng 11.1991, APEC kết nạp thêm Trung Quốc, lãnh thổ Hong Kong (Trung Quốc) và Đài Loan (Trung Quốc).Tháng\n11.1993, APEC có thêm Papua New Guinea, Mexico, tháng 11.1994 thêm Chile và tạm ngừng thời hạn xét kết nạp thành viên trong 3 năm.Đến tháng 11.1998, Việt Nam, Nga và Peru gia nhập APEC và Diễn đàn\nquyết định tạm ngừng thời hạn xem xét kết nạp thành viên mới thêm 10 năm nữa để củng cố tổ chức.Như vậy, đến nay APEC có 21 nền kinh tế thành viên, chiếm khoảng 52% diện tích lãnh thổ, 39% dân số, 70%\nnguồn tài nguyên thiên nhiên trên thế giới, đóng góp khoảng 59% GDP toàn cầu và gần 48% thương mại thế giới.Infographic: TTXVNAPEC bao gồm cả hai khu vực kinh tế mạnh và năng động nhất thế giới: khu\nvực Đông Á và khu vực Bắc Mỹ (gồm Mỹ, Canada và Mexico) với những nét đặc thù và vô cùng đa dạng về chính trị, xã hội, kinh tế và văn hóa. Chỉ trong 10 năm đầu tồn tại và phát triển, các nền kinh tế\nthành viên APEC đã đóng góp gần 70% cho sự tăng trưởng chung của nền kinh tế toàn cầu.Đặt mục tiêu phát triển kinh tế bình đẳng, bền vữngNội dung hoạt động của APEC xoay quanh 3 trụ cột chính là tự do\nhoá thương mại và đầu tư, tạo thuận lợi cho thương mại và đầu tư, và hợp tác kinh tế kỹ thuật với các chương trình hành động tập thể (CAP) và chương trình hành động quốc gia (IAP) của từng thành\nviên.Nói cách khác, mục tiêu của APEC không phải là để xây dựng một khối thương mại, một liên minh thuế quan hay một khu vực mậu dịch tự do như kiểu EU, NAFTA hay AFTA, mà là một diễn đàn kinh tế mở,\nnhằm xúc tiến các biện pháp kinh tế, thúc đẩy thương mại và đầu tư giữa các nền kinh tế thành viên trên cơ sở hoàn toàn tự nguyện trong khi thực sự mở cửa đối với tất cả các nước và khu vực khác.Tự do\nhoá thương mại và đầu tư mang lại nhiều lợi ích cho hoạt động hợp tác kinh tế trong APEC và các nền kinh tế thành viên thông qua việc giảm và xóa bỏ dần các hàng rào thuế quan và phi quan thuế cản trở\nhoạt động thương mại và đầu tư.Thuận lợi hóa kinh doanh tập trung vào việc giảm chi phí giao dịch trong kinh doanh, tăng cường trao đổi thông tin và tự do thương mại. Điều cốt yếu là thuận lợi hoá\nthương mại giúp các nhà xuất khẩu ở châu Á - Thái Bình Dương gặp gỡ và tiến hành kinh doanh hiệu quả hơn, do vậy làm giảm chi phí sản xuất và dẫn tới tăng cường trao đổi thương mại, hàng hoá và dịch\nvụ rẻ hơn, tốt hơn và cơ hội việc làm nhiều hơn.APEC đưa ra chương trình hợp tác kinh tế kỹ thuật nhằm hỗ trợ phát triển nguồn nhân lực, nâng cao năng lực của các thành viên APEC hướng tới sự phát\ntriển kinh tế bình đẳng, cân bằng và bền vững trong khu vực, tạo điều kiện thuận lợi nhất để triển khai các chương trình hành động thực hiện mục tiêu Bogor.Giảm thuế phí, tạo bùng nổ thương mạiSuốt\nhơn 3 thập kỷ qua, các thành viên của APEC đã nỗ lực không ngừng, tăng cường hợp tác và phát triển; đồng thời mở rộng và tăng cường liên kết kinh tế khu vực, theo tinh thần của mục tiêu chung qua các\nhội nghị thường niên, là thúc đẩy tự do hóa, thuận lợi hóa thương mại và đầu tư vào năm 2010 đối với các thành viên phát triển và năm 2020 đối với các thành viên đang phát triển.Với nguyên tắc hoạt\nđộng tự nguyện, linh hoạt, đồng thuận và cùng phát triển, nỗ lực thực hiện các mục tiêu đề ra đã mang lại những kết quả hết sức cụ thể và có ý nghĩa.Từ năm 1989 đến năm 2010, thương mại giữa các thành\nviên tăng gần 5 lần, từ 1,7 nghìn tỉ USD lên 9,9 nghìn tỉ USD; mức thuế trung bình trong khu vực giảm gần 6 lần, từ 16,9% năm 1989 xuống còn 5,8% năm 2010; chi phí giao dịch thương mại cũng giảm đáng\nkể, qua 2 lần cắt giảm 5% vào các năm 2006 và 2010.APEC là Diễn đàn hợp tác đa phương đầu tiên đạt thỏa thuận về Danh mục hàng hóa môi trường, theo đó, 54 mặt hàng môi trường giảm thuế ở mức dưới 5%\nvào năm 2015.Hiện nay, APEC đang tích cực xây dựng Kế hoạch triển khai Tầm nhìn APEC đến năm 2040. Đây là định hướng hợp tác lớn của APEC trong giai đoạn phát triển mới.Cùng với các cơ chế hợp tác\nkhác như Hiệp hội các quốc gia Đông Nam Á (ASEAN), Hiệp định Đối tác toàn diện và Tiến bộ xuyên Thái Bình Dương (CPTPP), Hiệp định đối tác kinh tế toàn diện khu vực (RCEP), liên kết kinh tế Đông Bắc\nÁ..., APEC đã và đang góp phần tích cực vào quá trình xây dựng một cấu trúc hợp tác khu vực theo hướng đa tầng nấc, duy trì vai trò đầu tàu của châu Á - Thái Bình Dương trong tiến trình tăng trưởng và\nliên kết kinh tế toàn cầu.",
