     "Column1": 38,
     "subject": "Tư Liệu",
     "title": "Lịch sử đau thương của Dải Gaza",
     "author": "Khánh Minh",
     "file_names": "43.txt",
     "file_texts": "Dải Gaza là gì? Dải Gaza là một khu vực nhỏ giáp Israel và Ai Cập trên biển Địa Trung Hải. Dải Gaza là phần cực tây của các lãnh thổ Palestine ở Tây Nam Á, có biên giới trên bộ với Ai Cập ở phía tây\nnam và Israel ở phía bắc và phía đông. Ở phía tây, nó giáp với Biển Địa Trung Hải.Gaza là một phần của Đế chế Ottoman trước khi bị Vương quốc Anh chiếm đóng từ năm 1918-1948 và Ai Cập từ năm\n1948-1967.Gần 20 năm sau khi Israel tuyên bố trở thành nhà nước vào năm 1948, nước này đã chiếm được Dải Gaza từ Ai Cập và Bờ Tây từ Jordan trong cuộc chiến năm 1967. Người Palestine tuyên bố chủ\nquyền đối với những vùng lãnh thổ này và coi chúng là một phần của nhà nước tương lai.Israel kiểm soát Gaza trong 38 năm, xây dựng 21 khu định cư của người Do Thái trong thời kỳ đó. Căng thẳng và bạo\nlực kéo dài trong nhiều năm.Các tòa nhà bị phá hủy sau cuộc không kích của Israel vào thành phố Gaza ở Dải Gaza ngày 8.10.2023. Ảnh: XinhuaNăm 1993, các hiệp định Oslo giữa Israel và Tổ chức Giải\nphóng Palestine (PLO) được ký kết nhằm mục đích thực hiện “quyền tự quyết của người dân Palestine”. Năm 1994, người Palestine nắm quyền kiểm soát với tư cách là chính quyền ở Gaza.Một phần của nỗ lực\nthúc đẩy hòa bình lớn hơn liên quan đến việc Israel tuân theo kế hoạch rút quân đơn phương do Thủ tướng Ariel Sharon đề xuất vào năm 2003 nhằm dỡ bỏ các khu định cư của Israel trên Dải Gaza.Năm 2005,\nIsrael từ bỏ quyền kiểm soát Dải Gaza dưới áp lực trong nước và quốc tế, rút 9.000 người định cư và lực lượng quân sự Israel khỏi Gaza.Ai kiểm soát Dải Gaza?Hamas - một trong hai đảng chính trị lớn ở\nvùng lãnh thổ Palestine - đã xung đột với các nhà lãnh đạo Palestine khi hiệp định Oslo được ký kết vào những năm 1990. Hamas lên nắm quyền ở Gaza sau khi giành chiến thắng trong cuộc bầu cử năm 2006.\nKhông có cuộc bầu cử nào được tổ chức kể từ đó.Mặc dù Israel đã từ bỏ quyền kiểm soát Dải Gaza nhưng nước này vẫn tiếp tục phong tỏa trên bộ, trên không và trên biển đối với Gaza kể từ năm 2007.Israel\nlập luận rằng, việc phong tỏa được thực hiện để giữ quyền kiểm soát biên giới Gaza, cản trở Hamas trở nên mạnh mẽ hơn và bảo vệ người Israel khỏi các cuộc tấn công bằng tên lửa của Palestine.Việc\nphong tỏa đã vấp phải sự chỉ trích của các nhóm nhân quyền và Liên Hợp Quốc, vốn coi Gaza vẫn nằm dưới sự chiếm đóng của quân đội Israel.Ủy ban Chữ Thập Đỏ Quốc tế nói rằng, lệnh phong tỏa vi phạm\nCông ước Geneva - tuyên bố bị các quan chức Israel bác bỏ.Cuộc bao vây Dải Gaza có ý nghĩa gì?Ngày 9.10.2023, Bộ trưởng Quốc phòng Israel Gallant tuyên bố tiến hành cuộc “bao vây toàn diện” Dải Gaza\ntrong giai đoạn đầu của cuộc chiến, cắt tất cả điện, thực phẩm và nhiên liệu. Dải Gaza phụ thuộc rất nhiều vào nước, điện và thực phẩm của Israel.Có bao nhiêu người sống ở Dải Gaza?Theo Gisha - tổ\nchức phi chính phủ của Israel - có hơn 2 triệu người sống ở Gaza, khiến nơi đây trở thành “một trong những vùng lãnh thổ đông dân nhất thế giới”.Với diện tích khoảng 365km2, Dải Gaza chỉ rộng gấp đôi\nthủ đô Washington D.C của Mỹ, nhưng có dân số gấp ba lần. Gaza nhỏ hơn Bờ Tây - với diện tích gần 5.700km2.Dải Gaza có diện tích khoảng 365km2 với dân số 2,1 triệu người. Nguồn: pcbs.gov.ps 2022Dân số\nở Gaza cực kỳ trẻ. UNICEF ước tính có khoảng 1 triệu trẻ em sống ở Dải Gaza, nghĩa là gần một nửa số người ở Gaza là trẻ em. Theo CIA, gần 40% dân số ở đây dưới 15 tuổi.Theo Cơ quan Cứu trợ và Việc\nlàm Liên Hợp Quốc (UNRWA), hơn 1,4 triệu cư dân ở Dải Gaza là người tị nạn Palestine.Thống kê của Ngân hàng Thế giới cho thấy, lãnh thổ này có tỷ lệ thất nghiệp cao nhất thế giới và Liên Hợp Quốc ước\ntính rằng khoảng 80% dân số dựa vào viện trợ quốc tế để tồn tại và tiếp cận các dịch vụ cơ bản.Trang web của UNRWA cho biết: “Trong ít nhất một thập kỷ rưỡi qua, tình hình kinh tế xã hội ở Gaza đã suy\ngiảm liên tục. Hiện còn rất ít lựa chọn cho người dân Gaza, những người đang phải sống dưới sự trừng phạt tập thể do lệnh phong tỏa tiếp tục có tác động tàn khốc đối với việc di chuyển của người dân\nđến và đi từ Dải Gaza, cũng như khả năng tiếp cận thị trường vốn vẫn bị hạn chế nghiêm ngặt”.Người dân tụ tập gần một tòa nhà bị phá hủy sau cuộc không kích của Israel ở thành phố Rafah, phía nam Dải\nGaza, ngày 9.10.2023. Ảnh: XinhuaĐiều gì khiến Dải Gaza dễ bị tổn thương?Vì thành phố Gaza thuộc Dải Gaza có mật độ dân số đông, nên các cuộc phản công có chủ đích như những cuộc phản công mà Israel\ntiến hành trong những ngày gần đây có khả năng cao nhằm vào dân thường. Những cuộc xung đột trước đây đã giết chết hàng trăm trẻ em.Theo truyền thông Israel, sau khi hơn 700 người Israel thiệt mạng\ntrong các cuộc tấn công bất ngờ của Hamas cuối tuần qua, một cuộc phản công dữ dội của lực lượng Israel ở Gaza cũng khiến ít nhất 560 người thiệt mạng.",
