     "Column1": 43,
     "subject": "Xã Hội",
     "title": "Khánh Hòa thu hồi 4 tỉ đồng tiền thất thoát từ các vụ án tham nhũng",
     "author": "Hữu Long",
     "file_names": "48.txt",
     "file_texts": "Ngày 28.11, Ban Chỉ đạo phòng, chống tham nhũng, tiêu cực tỉnh Khánh Hòa thông tin về cuộc họp của Thường trực Ban Chỉ đạo vào ngày 24.11 mới đây.Từ sau phiên họp thứ 4 của Ban Chỉ đạo tỉnh (ngày\n21.9) đến nay, địa phương đã phát hiện, xử lý kịp thời 2 tổ chức Đảng và 7 cán bộ, đảng viên vi phạm, trong đó, có 1 trường hợp bị xử lý hình sự; qua công tác thanh tra đã phát hiện sai phạm về kinh\ntế, nhất là trong công tác quản lý nhà nước về đất đai; việc thực hiện các kiến nghị của Kiểm toán Nhà nước từ năm 2022 trở về trước đạt kết quả tích cực.Về công tác thu hồi tài sản thất thoát, chiếm\nđoạt trong các vụ án, vụ việc tham nhũng, kinh tế, tiêu cực được quan tâm chỉ đạo thực hiện, trong kỳ, đã thu hồi được số tiền hơn 4 tỉ đồng\/3 vụ án, vụ việc thuộc diện Ban Chỉ đạo tỉnh theo dõi, chỉ\nđạo.Bên cạnh những kết quả đạt được, vẫn còn những tồn tại, hạn chế như việc chỉ đạo kiểm tra, xử lý các dự án ngoài ngân sách chậm tiến độ theo Thông báo số 256 năm 2021 và Thông báo số 700 năm 2023\ncủa Ban Thường vụ Tỉnh ủy còn chậm so với kế hoạch của UBND tỉnh đề ra, công tác phối hợp giữa các cơ quan chức năng trong việc xử lý một số dự án có vướng mắc chưa kịp thời, hiệu quả.Chưa hết, các cơ\nquan tiến hành tố tụng tỉnh đã tập trung chỉ đạo giải quyết các vụ án, vụ việc thuộc diện Ban Chỉ đạo tỉnh theo dõi, chỉ đạo nhưng chưa đảm bảo tiến độ theo yêu cầu của Ban Chỉ đạo tỉnh; việc thực\nhiện các kiến nghị của Kiểm toán Nhà nước, Thanh tra Chính phủ trong một số vụ việc còn chậm, nhất là việc chỉ đạo xử lý trách nhiệm của các tổ chức, cá nhân có liên quan.Trước đó, vào ngày 21.9, Ban\nChỉ đạo tỉnh Khánh Hòa đã họp, thống nhất kết thúc theo dõi, chỉ đạo 1 vụ án, 1 vụ việc bao gồm vụ án “lợi dụng chức vụ, quyền hạn trong khi thi hành công vụ” xảy ra tại Trường Cao đẳng Y tế Khánh\nHòa; vụ sai phạm trong việc giao đất tại khu vực sân bay Nha Trang để thanh toán cho các dự án BT, do kết thúc việc giải quyết theo quy định.Theo ông Lương Đức Hải – Trưởng Ban Nội chính Tỉnh ủy, vụ\nviệc sai phạm trong việc giao đất vàng tại khu vực sân bay Nha Trang cũ, thuộc diện Ban Chỉ đạo Trung ương về phòng, chống tham nhũng, tiêu cực và Ban Chỉ đạo tỉnh theo dõi.Đến nay, Cơ quan Cảnh sát\nđiều tra Công an tỉnh Khánh Hòa đã chuyển toàn bộ hồ sơ liên quan đến vụ việc này đến Cơ quan Điều tra hình sự Bộ Quốc phòng thụ lý, điều tra theo thẩm quyền.Vẫn theo ông Lương Đức Hải, sau khi hoàn\ntất bàn giao hồ sơ, vụ việc sai phạm giao “đất vàng” tại sân bay Nha Trang cũ, không thuộc thẩm quyền của địa phương. Từ cơ sở này, Ban Chỉ đạo tỉnh Khánh Hòa đã quyết định kết thúc theo dõi vụ việc.",
     "token": "Ngày_28.11 , Ban_Chỉ_đạo_phòng , chống tham_nhũng , tiêu_cực tỉnh Khánh_Hòa thông_tin về cuộc họp của Thường_trực Ban_Chỉ_đạo vào ngày 24.11 mới_đây . Từ_sau phiên họp thứ 4 của Ban_Chỉ_đạo_tỉnh ( ngày 21.9 ) đến nay , địa_phương đã phát_hiện , xử_lý kịp_thời 2 tổ chức_Đảng và 7 cán_bộ , đảng_viên vi_phạm , trong đó , có 1 trường_hợp bị xử_lý hình_sự ; qua công_tác thanh_tra đã phát_hiện sai_phạm về kinh_tế , nhất_là trong công_tác quản_lý_nhà_nước về đất_đai ; việc thực_hiện các kiến_nghị của Kiểm_toán Nhà_nước từ năm 2022 trở về trước đạt kết_quả tích_cực . Về công_tác thu_hồi tài_sản thất_thoát , chiếm_đoạt trong các vụ án , vụ_việc tham_nhũng , kinh_tế , tiêu_cực được quan_tâm chỉ_đạo thực_hiện , trong kỳ , đã thu_hồi được số tiền hơn 4 tỉ đồng \/ 3 vụ án , vụ_việc thuộc diện Ban_Chỉ_đạo_tỉnh theo_dõi , chỉ_đạo . Bên_cạnh những kết_quả đạt được , vẫn còn những tồn_tại , hạn_chế như việc chỉ_đạo kiểm_tra , xử_lý các dự_án ngoài ngân_sách chậm tiến_độ theo Thông_báo số 256 năm 2021 và Thông_báo số 700 năm 2023 của Ban_Thường_vụ Tỉnh_ủy còn chậm so với kế_hoạch của UBND_tỉnh đề ra , công_tác phối_hợp giữa các cơ_quan_chức_năng trong việc xử_lý một_số dự_án có vướng_mắc chưa kịp_thời , hiệu_quả . Chưa hết , các cơ_quan tiến_hành tố_tụng tỉnh đã tập_trung chỉ_đạo giải_quyết các vụ án , vụ_việc thuộc diện Ban_Chỉ_đạo_tỉnh theo_dõi , chỉ_đạo nhưng chưa đảm_bảo tiến_độ theo yêu_cầu của Ban_Chỉ_đạo_tỉnh ; việc thực_hiện các kiến_nghị của Kiểm_toán Nhà_nước , Thanh_tra Chính_phủ trong một_số vụ_việc còn chậm , nhất_là việc chỉ_đạo xử_lý trách_nhiệm của các tổ_chức , cá_nhân có liên_quan . Trước_đó , vào ngày 21.9 , Ban_Chỉ_đạo_tỉnh Khánh_Hòa đã họp , thống_nhất kết_thúc theo_dõi , chỉ_đạo 1 vụ án , 1 vụ_việc bao_gồm vụ án_“ lợi_dụng chức_vụ , quyền_hạn trong khi thi_hành công_vụ ” xảy ra tại Trường_Cao_đẳng Y_tế Khánh_Hòa ; vụ sai_phạm trong việc giao đất tại khu_vực sân_bay Nha_Trang để thanh_toán cho các dự_án BT , do kết_thúc việc giải_quyết theo quy_định . Theo_ông Lương_Đức_Hải – Trưởng_Ban Nội_chính Tỉnh_ủy , vụ_việc sai_phạm trong việc giao đất vàng tại khu_vực sân_bay Nha_Trang cũ , thuộc diện Ban_Chỉ_đạo_Trung_ương về phòng , chống tham_nhũng , tiêu_cực và Ban_Chỉ_đạo_tỉnh theo_dõi . Đến_nay , Cơ_quan Cảnh_sát điều_tra Công_an tỉnh Khánh_Hòa đã chuyển toàn_bộ hồ_sơ liên_quan đến vụ_việc này đến Cơ_quan Điều_tra hình_sự Bộ_Quốc_phòng thụ_lý , điều_tra theo thẩm_quyền . Vẫn_theo ông Lương_Đức_Hải , sau khi hoàn_tất bàn_giao hồ_sơ , vụ_việc sai_phạm giao_“ đất vàng ” tại sân_bay Nha_Trang cũ , không thuộc thẩm_quyền của địa_phương . Từ_cơ_sở này , Ban_Chỉ_đạo_tỉnh Khánh_Hòa đã quyết_định kết_thúc theo_dõi vụ_việc .",
