     "file_texts": "Xuống tàu, du khách được chào đón bằng một số tiết mục văn nghệ, múa rồng lân, tham quan quan những điểm đến đặc sắc tại thành phố Hạ Long, Hà Nội hay du ngoạn Vịnh Hạ Long. 12h ngày 29.11, tàu tiếp\ntục hải trình tới Đà Nẵng, Hongkong, trước khi trở về Xà Khẩu (Trung Quốc).Tham gia lễ đón đoàn khách, đại diện Sở du lịch Quảng Ninh cho rằng, chuyến tàu khách đầu tiên từ Xà Khẩu trở lại Hạ Long có\ný nghĩa rất lớn đối với du lịch tỉnh, cho thấy tín hiệu trở lại tích cực của thị trường khách du lịch Trung Quốc sau dịch COVID-19 và sau các hạn chế trong chính sách xuất nhập cảnh thời gian\ntrước.Lãnh đạo Sở Du lịch tặng hoa đoàn thủy thủ tàu Zhao Shang Yi Dun. Ảnh: Đoàn HưngTheo lịch đăng ký từ nay đến tháng 3.2024, dự kiến tàu Zhao Shang Yi Dun sẽ cập cảng tàu khách quốc tế Hạ Long 14\nlần mang theo trên 12.000 lượt khách.Ông Lương Thế Tuyên - Giám đốc kinh doanh Cảng tàu khách quốc tế Hạ Long - cho biết, mùa tàu biển 2023 đã khởi động từ tháng 10 với nhiều siêu tàu khách quốc tế\nđưa du khách từ châu Âu, châu Mỹ tới Hạ Long. Tuy nhiên, những chuyến tàu từ Trung Quốc đến với Vịnh di sản vẫn mang những ý nghĩa đặc biệt, bởi đây là thị trường khách truyền thống, thân cận.Đây cũng\nlà tín hiệu tích cực cho thấy khách quốc tế du ngoạn qua đường biển năm 2024 sẽ phục hồi mạnh mẽ. Tính đến thời điểm hiện tại, số lượt tàu đăng ký cập Cảng tàu khách quốc tế Hạ Long trong năm 2024 đã\ngần 60 chuyến tàu với trên 70.000 lượt khách. Các tàu khách đăng ký cập cảng trong năm 2024 thuộc nhiều thương hiệu lớn và nổi tiếng thế giới như Mein Schiff 6 và 5, Celebrity Solstice, Noordam, MSC\nSplendida, Westerdam…",
     "token": "Xuống_tàu , du_khách được chào_đón bằng một_số tiết_mục văn_nghệ , múa rồng lân , tham_quan_quan những điểm đến đặc_sắc tại thành_phố Hạ_Long , Hà_Nội hay du_ngoạn Vịnh_Hạ_Long . 12h ngày 29.11 , tàu tiếp_tục hải_trình tới Đà_Nẵng , Hongkong , trước khi trở về Xà_Khẩu ( Trung_Quốc ) . Tham_gia lễ đón đoàn khách , đại_diện Sở_du_lịch Quảng_Ninh cho rằng , chuyến tàu khách đầu_tiên từ Xà_Khẩu trở_lại Hạ_Long có ý_nghĩa rất lớn đối_với du_lịch tỉnh , cho thấy tín_hiệu trở_lại tích_cực của thị_trường khách du_lịch Trung_Quốc sau dịch_COVID - 19 và sau các hạn_chế trong chính_sách xuất_nhập_cảnh thời_gian trước . Lãnh_đạo_Sở_Du_lịch tặng hoa đoàn thủy_thủ tàu Zhao_Shang Yi_Dun . Ảnh : Đoàn_HưngTheo lịch đăng_ký từ nay đến tháng 3.2024 , dự_kiến tàu Zhao_Shang Yi_Dun sẽ cập cảng tàu khách quốc_tế Hạ_Long 14 lần mang theo trên 12.000 lượt khách . Ông_Lương_Thế_Tuyên - Giám_đốc kinh_doanh Cảng_tàu_khách quốc_tế Hạ_Long - cho biết , mùa tàu biển 2023 đã khởi_động từ tháng 10 với nhiều siêu tàu khách quốc_tế đưa du_khách từ châu_Âu , châu_Mỹ tới Hạ_Long . Tuy_nhiên , những chuyến tàu từ Trung_Quốc đến với Vịnh_di_sản vẫn mang những ý_nghĩa đặc_biệt , bởi đây là thị_trường khách truyền_thống , thân_cận . Đây_cũng là tín_hiệu tích_cực cho thấy khách quốc_tế du_ngoạn qua đường_biển năm 2024 sẽ phục_hồi mạnh_mẽ . Tính_đến thời_điểm hiện_tại , số lượt tàu đăng_ký cập_Cảng tàu khách quốc_tế Hạ_Long trong năm 2024 đã gần 60 chuyến tàu với trên 70.000 lượt khách . Các tàu khách đăng_ký cập cảng trong năm 2024_thuộc nhiều thương_hiệu lớn và nổi_tiếng thế_giới như Mein_Schiff 6 và 5 , Celebrity_Solstice , Noordam , MSC_Splendida , Westerdam …",
