     "file_texts": "Khoảng 11h20 trưa 27.11, xe trộn bê tông biển kiểm soát 24C - 067.XX do tài xế Nguyễn Hồng H (sinh năm 2000, trú tại thôn An Thành, xã Quang Kim, huyện Bát Xát) điều khiển chở theo một người khi đến\nKm43+200, Tỉnh lộ 156 địa phận xã Bản Vược, huyện Bát Xát, tỉnh Lào Cai thì bất ngờ mất lái lao xuống vực sâu hơn 50 mét.\"Thời điểm phương tiện có dấu hiệu mất phanh lao xuống vực, tài xế xe bồn chở\nbê tông đã nhanh trí nhảy ra ngoài còn người ngồi ghế phụ là anh Phạm Ngọc T (sinh năm 1985, trú tại thôn Nậm Chủ, xã Bản Cầm, huyện Bảo Thắng, tỉnh Lào Cai) bị mắc kẹt\", lãnh đạo UBND xã Bản Vược cho\nhay.Xe trộn bê tông bị hỏng nặng, vỡ nát nhiều bộ phận sau khi lao xuống vực sâu. Ảnh: NDCCNgay sau khi xảy ra vụ tai nạn, lực lượng chức năng đã có mặt tại hiện trường, phối hợp với chính quyền địa\nphương và người dân giải cứu và đưa anh T đi bệnh viện cấp cứu.Trong ngày hôm nay (28.11), lực lượng chức năng sẽ cẩu xe trộn bê tông để tiến hành khám nghiệm hiện trường, điều tra làm rõ nguyên nhân\nvụ tai nạn.",
     "token": "Khoảng_11h20 trưa 27.11 , xe trộn bê_tông biển kiểm_soát 24C - 067 . XX do tài_xế Nguyễn_Hồng H ( sinh năm 2000 , trú tại thôn An_Thành , xã Quang_Kim , huyện Bát_Xát ) điều_khiển chở theo một người khi đến Km43 + 200 , Tỉnh_lộ 156 địa_phận xã Bản_Vược , huyện Bát_Xát , tỉnh Lào_Cai thì bất_ngờ mất lái lao xuống vực sâu hơn 50 mét . \" Thời_điểm phương_tiện có dấu_hiệu mất phanh_lao xuống vực , tài_xế xe_bồn chở bê_tông đã nhanh_trí nhảy ra ngoài còn người ngồi ghế phụ là anh Phạm_Ngọc T ( sinh năm 1985 , trú tại thôn Nậm_Chủ , xã Bản_Cầm , huyện Bảo_Thắng , tỉnh Lào_Cai ) bị mắc_kẹt \" , lãnh_đạo UBND xã Bản_Vược cho_hay . Xe_trộn bê_tông bị hỏng nặng , vỡ nát nhiều bộ_phận sau khi lao xuống vực sâu . Ảnh : NDCCNgay sau khi xảy ra vụ tai_nạn , lực_lượng chức_năng đã có_mặt tại hiện_trường , phối_hợp với chính_quyền địa_phương và người_dân giải_cứu và đưa anh T đi bệnh_viện cấp_cứu . Trong_ngày hôm_nay ( 28.11 ) , lực_lượng chức_năng sẽ cẩu xe trộn bê_tông để tiến_hành khám_nghiệm hiện_trường , điều_tra làm rõ nguyên_nhân vụ tai_nạn .",
