     "file_texts": "Điều 48 quy định về việc đăng ký, cấp phép khai thác, sử dụng tài nguyên nước.1. Các trường hợp phải đăng ký, cấp phép khai thác, sử dụng tài nguyên nước trừ trường hợp quy định tại khoản 2 Điều này\ngồm:a) Khai thác, sử dụng nước trực tiếp trên sông, suối, kênh, rạch, hồ, ao, đầm, phá, biển, các tầng chứa nước và các dạng tích tụ nước khác;b) Công trình ngăn sông, suối, kênh, rạch và các công\ntrình tạo nguồn nước khác;c) Tạo không gian chứa, trữ nước để tạo cảnh quan, thoát nước mưa và các mục đích sử dụng khác;d) Sử dụng nước trong các moong khai thác khoáng sản để tuyển quặng, bơm hút\nnước để tháo khô trong moong khai thác khoáng sản; sử dụng mặt nước để nuôi trồng thuỷ sản bằng lồng bè trên sông, suối; sử dụng mặt nước hồ, ao trong khu du lịch, vui chơi giải trí; sử dụng mặt nước\nđể làm điện mặt trời, tạo cảnh quan và các trường hợp sử dụng nước khác.2. Các trường hợp khai thác, sử dụng tài nguyên nước không phải đăng ký, cấp phép gồm:a) Khai thác, sử dụng nước cho sinh hoạt\ncủa hộ gia đình, các hoạt động văn hóa, tôn giáo, nghiên cứu khoa học; khai thác, sử dụng nước biển để sản xuất muối;b) Các công trình khai thác, sử dụng nước quy định tại khoản 1 Điều này có quy mô\nnhỏ;c) Khai thác, sử dụng nước tại các địa phương hoặc trên cả nước trong thời gian xảy ra tình trạng khẩn cấp do Ủy ban thường vụ Quốc hội ban bố;d) Khai thác, sử dụng nước để phòng cháy, chữa\ncháy;đ) Khai thác, sử dụng nước để cấp nước sinh hoạt tại các khu vực trong thời gian xảy ra tình trạng hạn hán, thiếu nước, xâm nhập mặn hoặc các sự cố ô nhiễm, dịch bệnh do cấp có thẩm quyền ban\nhành theo quy định.Cũng theo điều này, việc cấp phép phải đảm bảo đúng thẩm quyền, đúng đối tượng và trình tự, thủ tục theo quy định của pháp luật; đảm bảo lợi ích hợp pháp của tổ chức, cá nhân có\nliên quan theo nguyên tắc không ảnh hưởng đến quyền khai thác nước của tổ chức, cá nhân đã được cấp giấy phép.",
     "token": "Điều_48 quy_định về việc đăng_ký , cấp phép khai_thác , sử_dụng tài_nguyên nước . 1 . Các_trường_hợp phải đăng_ký , cấp phép khai_thác , sử_dụng tài_nguyên nước trừ trường_hợp quy_định tại khoản 2 Điều này gồm : a ) Khai_thác , sử_dụng nước trực_tiếp trên sông , suối , kênh , rạch , hồ , ao , đầm , phá , biển , các tầng chứa_nước và các dạng tích_tụ nước khác ; b ) Công_trình ngăn sông , suối , kênh , rạch và các công_trình tạo nguồn nước khác ; c ) Tạo không_gian chứa , trữ nước để tạo cảnh_quan , thoát nước mưa và các mục_đích sử_dụng khác ; d ) Sử_dụng nước trong các moong khai_thác khoáng_sản để tuyển quặng , bơm hút nước để tháo khô trong moong khai_thác khoáng_sản ; sử_dụng mặt_nước để nuôi_trồng thuỷ_sản bằng lồng_bè trên sông , suối ; sử_dụng mặt_nước hồ , ao trong khu du_lịch , vui_chơi giải_trí ; sử_dụng mặt_nước để làm điện mặt_trời , tạo cảnh_quan và các trường_hợp sử_dụng nước khác . 2 . Các_trường_hợp khai_thác , sử_dụng tài_nguyên nước không phải đăng_ký , cấp phép gồm : a ) Khai_thác , sử_dụng nước cho sinh_hoạt của hộ gia_đình , các hoạt_động văn_hóa , tôn_giáo , nghiên_cứu khoa_học ; khai_thác , sử_dụng nước_biển để sản_xuất muối ; b ) Các công_trình khai_thác , sử_dụng nước quy_định tại khoản 1 Điều này có quy_mô nhỏ ; c ) Khai_thác , sử_dụng nước tại các địa_phương hoặc trên cả nước trong thời_gian xảy ra tình_trạng khẩn_cấp do Ủy_ban thường_vụ Quốc_hội ban_bố ; d ) Khai_thác , sử_dụng nước để phòng cháy , chữa cháy ; đ ) Khai_thác , sử_dụng nước để cấp_nước sinh_hoạt tại các khu_vực trong thời_gian xảy ra tình_trạng hạn_hán , thiếu nước , xâm_nhập mặn hoặc các sự_cố ô_nhiễm , dịch_bệnh do cấp có thẩm_quyền ban_hành theo quy_định . Cũng_theo điều này , việc cấp phép phải đảm_bảo đúng thẩm_quyền , đúng đối_tượng và trình_tự , thủ_tục theo quy_định của pháp_luật ; đảm_bảo lợi_ích hợp_pháp của tổ_chức , cá_nhân có liên_quan theo nguyên_tắc không ảnh_hưởng đến quyền khai_thác nước của tổ_chức , cá_nhân đã được cấp giấy_phép .",
     "remove_stopword": "điều_48 quy_định đăng_ký , phép khai_thác , tài_nguyên . 1 . các_trường_hợp đăng_ký , phép khai_thác , tài_nguyên trừ trường_hợp quy_định khoản 2 : a ) khai_thác , sông , suối , kênh , rạch , hồ , ao , đầm , phá , biển , tầng chứa_nước dạng tích_tụ ; b ) công_trình ngăn sông , suối , kênh , rạch công_trình ; c ) không_gian chứa , trữ cảnh_quan , thoát mưa mục_đích ; d ) moong khai_thác khoáng_sản tuyển quặng , bơm hút tháo khô moong khai_thác khoáng_sản ; mặt_nước nuôi_trồng thuỷ_sản lồng_bè sông , suối ; mặt_nước hồ , ao khu du_lịch , vui_chơi giải_trí ; mặt_nước điện mặt_trời , cảnh_quan trường_hợp . 2 . các_trường_hợp khai_thác , tài_nguyên đăng_ký , phép : a ) khai_thác , sinh_hoạt hộ gia_đình , hoạt_động văn_hóa , tôn_giáo , nghiên_cứu khoa_học ; khai_thác , nước_biển sản_xuất muối ; b ) công_trình khai_thác , quy_định khoản 1 quy_mô ; c ) khai_thác , địa_phương xảy khẩn_cấp ủy_ban thường_vụ quốc_hội ban_bố ; d ) khai_thác , phòng cháy , chữa cháy ; đ ) khai_thác , cấp_nước sinh_hoạt khu_vực xảy hạn_hán , , xâm_nhập mặn sự_cố ô_nhiễm , dịch_bệnh thẩm_quyền ban_hành quy_định . cũng_theo , phép thẩm_quyền , đối_tượng trình_tự , thủ_tục quy_định pháp_luật ; lợi_ích hợp_pháp tổ_chức , nguyên_tắc ảnh_hưởng quyền khai_thác tổ_chức , giấy_phép .",
