     "file_texts": "Thông tin từ Công an quận Cầu Giấy (Hà Nội) cho hay, vào lúc 0h49 ngày 28.11, một nhà dân trong ngõ 132 Cầu Giấy xảy ra cháy.Nhận tin báo, Đội cảnh sát PCCC&CNCH, Công an quận Cầu Giấy đã điều nhiều\nxe chữa cháy cùng cán bộ chiến sĩ tới hiện trường dập lửa, cứu nạn. Đến khoảng 1h19 cùng ngày, đám cháy được dập tắt.Khu vực tầng 1 gần như bị thiêu rụi. Ảnh: Công an cung cấpNgôi nhà bị cháy có diện\ntích mặt bằng khoảng 30m2, cao 4 tầng (cháy ở khu vực tầng 1). Đây là nhà ở kết hợp kinh doanh quần áo nên có nhiều vật liệu dễ cháy, nhiều khói.Thời điểm xảy ra cháy trong nhà có 5 người. Khi phát\nhiện cháy, chủ nhà đã mở cửa ban công tầng 2, cùng các thành viên trong gia đình tự thoát nạn ra ngoài thành công.Cảnh sát PCCC sau đó đã kịp thời hướng dẫn 3 người dân nhà bên cạnh thoát ra bên ngoài\ntheo cầu thang bộ.Vụ cháy không gây thiệt hại về người, nguyên nhân vụ cháy đang được điều tra làm rõ.",
