     "file_texts": "Theo UBND tỉnh Lâm Đồng, trong năm 2023, các chuyến bay nội địa bình quân phục vụ 40 chuyến\/ngày đi - đến với sản lượng hành khách trung bình 6.700 lượt hành khách.Đối với các đường bay quốc tế (từ\nnăm 2017 đến nay) đã phục vụ 1.723 chuyến bay với tổng 237.783 lượt khách quốc tế.Trong đó có sự đóng góp không nhỏ của Công ty cổ phần hàng không Vietjet, đặc biệt là Vietjet Air đang duy trì khai\nthác đường bay Incheon (Hàn Quốc) đi - đến Đà Lạt với tần suất 6 chuyến bay\/tuần tạo điều kiện đưa du khách Hàn Quốc đến Lâm Đồng, góp phần phát triển du lịch, giao thương và phát triển kinh tế - xã\nhội của địa phương.Cảng hàng không Liên Khương. Ảnh: Cổng thông tin UBND tỉnh Lâm ĐồngTuy nhiên, hiện nay Cảng hàng không Liên Khương chưa khai thác đường bay quốc tế đến Singapore, trong khi đây là\nkhu vực có nhiều tiềm năng về hợp tác đầu tư, phát triển du lịch, giao thương hàng hóa.Do đó, để tạo điều kiện cho tỉnh Lâm Đồng kết nối với Singapore trong việc hợp tác đầu tư, phát triển kinh tế,\nđồng thời, hỗ trợ địa phương quảng bá du lịch, phối hợp tổ chức các chương trình phát triển du lịch, thương mại..., UBND tỉnh Lâm Đồng đề nghị Công ty cổ phần hàng không Vietjet xúc tiến mở đường bay\nquốc tế từ Cảng hàng không Liên Khương đến Singapore.Cảng hàng không Liên Khương hiện là Cảng hàng không nội địa phục vụ hoạt động bay dân dụng và hoạt động bay quân sự, tiếp nhận các chuyến bay quốc\ntế không thường lệ và nội địa thường lệ, không thường lệ, các tàu bay tư nhân, các loại tàu bay khác khi được cấp phép khai thác.",
