     "Column1": 60,
     "subject": "Xã Hội",
     "title": "Bộ Xây dựng ủng hộ kịch bản 71,6 tỉ USD làm đường sắt cao tốc Bắc – Nam",
     "author": "Xuyên Đông",
     "file_names": "63.txt",
     "file_texts": "Đề án chủ trương đầu tư đường sắt cao tốc Bắc – Nam của Bộ Giao thông Vận tải gồm 3 kịch bản, kịch bản 1 (dự kiến khoảng 67,32 tỉ USD); kịch bản 2 (dự kiến khoảng 72,02 tỉ USD); kịch bản 3 (dự kiến\nkhoảng 71,60 tỉ USD).Cho ý kiến vấn đề này, Bộ trưởng Bộ Xây dựng cho biết, Bộ Xây dựng thống nhất kịch bản 3 (dự kiến khoảng 71,60 tỉ USD).Để nâng cao tính khả thi của kịch bản 3, Bộ Xây dựng lưu ý\nhoàn chỉnh một số nội dung sau:Hiện nay, đề án chưa thể hiện rõ việc nâng cấp, hiện đại hóa tuyến đường sắt Bắc – Nam bằng khổ đường cụ thể nào.Với xu thế hội nhập, đảm bảo yêu cầu liên vận quốc tế\ntrong quá trình vận hành sau này, Bộ Giao thông vận tải cần nghiên cứu, theo hướng nâng cấp, hiện đại hóa tuyến đường sắt Bắc – Nam bằng hình thức thay thế toàn bộ khổ đường hiện hữu 1.000mm bằng khổ\nđường tiêu chuẩn 1.435mm trong quá trình triển khai thực hiện, đảm bảo thực hiện đúng chỉ đạo của Bộ Chính trị.Cụ thể, tại Kết luận số 49-KL\/TW của Bộ Chính trị ngày 28.2.2023: Đường sắt tốc độ cao\ntrên trục Bắc – Nam là trục “xương sống”, khai thác hiệu quả các tuyến đường sắt hiện có, kết nối hiệu quả với các tuyến đường sắt độ thị, các trung tâm kinh tế lớn, đầu mối vận tải trong nước (cảng\nbiển, cảng hàng không, của khẩu quốc tế) và liên vận quốc tế.Bộ Xây dựng cũng cho biết, đề án đề xuất tuyến đường sắt tốc độ cao trên trục Bắc – Nam có chiều dài 1.545km, đi qua 20 tỉnh, thành phố\ntrực thuộc Trung ương.Hiện nay, các tỉnh\/thành đang trong quá trình lập, phê duyệt Quy hoạch vùng. Quy hoạch tỉnh và các đồ án quy hoạch xây dựng, đồng thời trong bối cảnh tốc độ đô thị hóa ngày một\ntăng cao có thể làm phát sinh các tỉnh huống làm thay đổi hướng tuyến thiết kế đường sắt cao tốc Bắc – Nam kéo theo việc phải điều chỉnh khối lượng công trình dẫn đến thay đổi tổng mức đầu tư của dự\nán.Vì vậy, Bộ Xây dựng đề nghị Bộ Giao thông Vận tải cần phối hợp chặt chẽ với các địa phương, nơi có tuyến đường sắt đi qua để đảm bảo giữ nguyên được kết quả thỏa thuận hướng tuyến như đã được thể\nhiện tại đề án.Dự án đường sắt tốc độ cao trên trục Bắc – Nam có tổng mức đầu tư rất lớn. Do đó, để đảm bảo tính khả thi của đề án, Bộ Giao thông Vận tải cần bổ sung các căn cứ pháp lý được áp dụng để\nđề xuất sơ bộ tổng mức đầu tư như đã được xác định của dự án.",
     "token": "Đề_án chủ_trương đầu_tư đường_sắt_cao_tốc_Bắc –_Nam của Bộ_Giao_thông Vận_tải gồm 3 kịch_bản , kịch_bản 1 ( dự_kiến khoảng 67,32 tỉ USD ) ; kịch_bản 2 ( dự_kiến khoảng 72,02 tỉ USD ) ; kịch_bản 3 ( dự_kiến khoảng 71,60 tỉ USD ) . Cho_ý_kiến vấn_đề này , Bộ_trưởng Bộ_Xây_dựng cho_biết , Bộ_Xây_dựng_thống_nhất kịch_bản 3 ( dự_kiến khoảng 71,60 tỉ USD ) . Để_nâng cao_tính khả_thi của kịch_bản 3 , Bộ_Xây_dựng lưu_ý hoàn_chỉnh một_số nội_dung sau : Hiện_nay , đề_án chưa thể_hiện rõ việc nâng_cấp , hiện_đại_hóa tuyến đường_sắt_Bắc – Nam_bằng khổ đường cụ_thể_nào . Với_xu thế hội_nhập , đảm_bảo yêu_cầu liên_vận quốc_tế trong quá_trình vận_hành sau_này , Bộ_Giao_thông vận_tải cần nghiên_cứu , theo hướng nâng_cấp , hiện_đại_hóa tuyến đường_sắt_Bắc – Nam_bằng hình_thức thay_thế toàn_bộ khổ_đường hiện_hữu 1.000 mm bằng khổ_đường tiêu_chuẩn 1.435 mm trong quá_trình triển_khai thực_hiện , đảm_bảo thực_hiện đúng chỉ_đạo của Bộ_Chính_trị . Cụ_thể , tại Kết_luận số 49 - KL \/ TW của Bộ_Chính_trị ngày 28.2.2023 : Đường_sắt tốc_độ cao trên trục_Bắc – Nam_là_trục_“_xương_sống ” , khai_thác hiệu_quả các tuyến đường_sắt hiện có , kết_nối hiệu_quả với các tuyến đường_sắt độ_thị , các trung_tâm kinh_tế lớn , đầu_mối vận_tải trong nước ( cảng biển , cảng_hàng_không , của khẩu quốc_tế ) và liên_vận quốc_tế . Bộ_Xây_dựng cũng cho_biết , đề_án đề_xuất tuyến đường_sắt tốc_độ cao trên trục_Bắc – Nam có chiều dài 1.545 km , đi qua 20 tỉnh , thành_phố trực_thuộc Trung_ương . Hiện_nay , các tỉnh \/ thành đang trong quá trình_lập , phê_duyệt Quy_hoạch_vùng . Quy_hoạch tỉnh và các đồ_án quy_hoạch xây_dựng , đồng_thời trong bối_cảnh tốc_độ đô_thị_hóa ngày một tăng cao có_thể làm phát_sinh các tỉnh_huống làm thay_đổi hướng tuyến thiết_kế đường_sắt cao_tốc_Bắc – Nam_kéo theo việc phải điều_chỉnh khối_lượng công_trình dẫn đến thay_đổi tổng mức đầu_tư của dự_án . Vì_vậy , Bộ_Xây_dựng đề_nghị Bộ_Giao_thông Vận_tải cần phối_hợp chặt_chẽ với các địa_phương , nơi có tuyến đường_sắt đi qua để đảm_bảo giữ nguyên được kết_quả thỏa_thuận hướng tuyến như đã được thể_hiện tại đề_án . Dự_án đường_sắt tốc_độ cao trên trục_Bắc – Nam có tổng mức đầu_tư rất lớn . Do_đó , để đảm_bảo tính khả_thi của đề_án , Bộ_Giao_thông Vận_tải cần bổ_sung các căn_cứ pháp_lý được áp_dụng để đề_xuất sơ_bộ tổng mức đầu_tư như đã được xác_định của dự_án .",
