     "file_texts": "Theo Đài Khí tượng Thủy văn khu vực Nam Bộ, áp cao lạnh lục địa được tăng cường trở lại từ ngày 30.11-1.12. Rãnh áp thấp xích đạo có trục 4-6 độ vĩ Bắc.Trên cao, áp cao cận nhiệt đới có trục qua Trung\nBộ xu hướng hoạt động mạnh dần và lấn Tây từ ngày 29-30.11, sau đó đến khoảng ngày 3-5.12 suy yếu dần.Nhiễu động gió Đông trên cao tác động đến khu vực Nam Bộ trong khoảng ngày 29.11-1.12 và từ ngày\n3-5.12. Trên các vùng biển Nam Bộ, gió Đông Bắc hoạt động với cường độ trung bình đến mạnh.Trong những ngày tới, thời tiết Nam Bộ ít mưa, nắng nhiều, thuận lợi cho các hoạt động ngoài trời. Khoảng\nngày 30.11 và từ ngày 3-5.12 mưa xuất hiện nhiều hơn, mưa dông xảy ra chủ yếu về chiều tối, trong cơn dông còn kèm theo gió giật mạnh, sấm sét có thể gây nguy hiểm cho người dân.Trong 24h tới, tốc độ\ngió Đông Bắc trên biển Bà Rịa - Vũng Tàu đến Cà Mau, gió có lúc mạnh cấp 6-7, giật cấp 7-8, sóng cao 2,0- 3,5 m, biển động.Đỉnh triều cao nhất trạm Vũng Tàu xuất hiện vào chiều ngày 28.11. Gió mạnh,\nsóng lớn kết hợp với triều cao có thể gây ra hiện tượng nước dâng ven bờ từ 0,1-0,3 m.Mực nước tại hầu hết các trạm vùng hạ lưu sông Sài Gòn - Đồng Nai tiếp tục lên theo kỳ triều cường ngày 15.10 Âm\nlịch.Cụ thể, trạm Phú An và Nhà Bè ở khoảng 1,55-1,60 m ở mức xấp xỉ hoặc dưới báo động III khoảng 0,05 m. Thời gian xuất hiện đỉnh triều từ 4-7h và 17-19h. Trạm Thủ Dầu Một ở khoảng 1,67-1,73 m trên\nmức báo động III từ 0,07-0,13 m. Đây là kỳ triều cường cao cần đề phòng ngập úng những vùng trũng thấp và ven sông.",
