     "Column1": 68,
     "subject": "Y Tế",
     "title": "Chuyển tuyến khám chữa bệnh bằng giấy hay điện tử?",
     "author": "Hà Lê",
     "file_names": "70.txt",
     "file_texts": "Phân tích, làm rõ thêm về việc chuyển tuyến khám, chữa bệnh, Bộ trưởng Bộ Y tế Đào Hồng Lan cho rằng, giải quyết vấn đề chuyển tuyến nhằm giải quyết thủ tục hành chính cho người dân. Tuy nhiên, cũng\nphải bảo đảm sự bền vững của hệ thống y tế, tránh quả tải dồn lên một cấp nào đó.Thời gian qua việc thực hiện Luật Khám, chữa bệnh (2009), có quy định dựa trên các điều kiện, tiêu chí của các cơ sở\nkhám, chữa bệnh phân làm 4 cấp chuyên môn kỹ thuật. Luật Khám, chữa bệnh (sửa đổi) sẽ thành lập 3 cấp để đảm bảo được điều kiện cấp nào được khám, chữa bệnh ở mức độ nào. Điều này vừa căn cứ vào khả\nnăng đáp ứng của các cơ sở và tình trạng của người bệnh thì bố trí phù hợp.Bộ trưởng cho hay, để đảm bảo tránh việc quá tải dồn lên tuyến trên, hiện nay việc chuyển tuyến được thực hiện thành 2\nluồng:Thứ nhất, từ tuyến dưới lên tuyến trên, nếu cơ sở không đáp ứng được các yêu cầu về khám, chữa bệnh cho người dân.Hai là, từ tuyến trên xuống tuyến dưới, khi tình trạng bệnh tật ổn định thì\nchuyển về tuyến dưới để đảm bảo tiếp tục công tác điều trị lâu dài.Việc này cũng hoàn toàn phù hợp để đảm bảo được chất lượng cho công tác khám, chữa bệnh và điều trị. Đồng thời, để giảm thủ tục hành\nchính, Bộ Y tế đang tập trung chỉ đạo vấn đề sử dụng hình thức chuyển tuyến điện tử cũng như hồ sơ quản lý sức khỏe điện tử.Với vai trò của giấy chuyển tuyến rất cụ thể, ghi rõ được tình trạng lịch sử\nđiều trị, cũng như tóm tắt bệnh án… thì việc chuyển tuyến dù hình thức giấy hay điện tử vẫn là điều rất cần thiết.",
     "token": "Phân_tích , làm rõ thêm về việc chuyển tuyến khám , chữa bệnh , Bộ_trưởng Bộ_Y_tế Đào_Hồng_Lan cho rằng , giải_quyết vấn_đề chuyển tuyến nhằm giải_quyết thủ_tục hành_chính cho người_dân . Tuy_nhiên , cũng phải bảo_đảm sự bền_vững của hệ_thống y_tế , tránh quả tải dồn lên một cấp nào đó . Thời_gian qua việc thực_hiện Luật_Khám , chữa bệnh ( 2009 ) , có quy_định dựa trên các điều_kiện , tiêu_chí của các cơ_sở khám , chữa bệnh phân làm 4 cấp chuyên_môn kỹ_thuật . Luật_Khám , chữa bệnh ( sửa_đổi ) sẽ thành_lập 3 cấp để đảm_bảo được điều_kiện cấp nào được khám , chữa bệnh ở mức_độ nào . Điều này vừa căn_cứ vào khả_năng đáp_ứng của các cơ_sở và tình_trạng của người_bệnh thì bố_trí phù_hợp . Bộ_trưởng cho_hay , để đảm_bảo tránh việc quá_tải dồn lên tuyến trên , hiện_nay việc chuyển tuyến được thực_hiện thành 2 luồng : Thứ_nhất , từ tuyến dưới lên tuyến trên , nếu cơ_sở không đáp_ứng được các yêu_cầu về khám , chữa bệnh cho người_dân . Hai_là , từ tuyến trên xuống tuyến dưới , khi tình_trạng bệnh_tật ổn_định thì chuyển về tuyến dưới để đảm_bảo tiếp_tục công_tác điều_trị lâu_dài . Việc_này cũng hoàn_toàn phù_hợp để đảm_bảo được chất_lượng cho công_tác khám , chữa bệnh và điều_trị . Đồng_thời , để giảm thủ_tục hành_chính , Bộ_Y_tế đang tập_trung chỉ_đạo vấn_đề sử_dụng hình_thức chuyển_tuyến điện_tử cũng như hồ_sơ quản_lý sức_khỏe điện_tử . Với vai trò của giấy chuyển tuyến rất cụ_thể , ghi rõ được tình_trạng lịch_sử điều_trị , cũng như tóm_tắt bệnh_án … thì việc chuyển tuyến dù hình_thức giấy hay điện_tử vẫn là điều rất cần_thiết .",
     "remove_stopword": "phân_tích , tuyến khám , chữa bệnh , bộ_trưởng bộ_y_tế đào_hồng_lan , giải_quyết tuyến giải_quyết thủ_tục hành_chính người_dân . , bảo_đảm bền_vững hệ_thống y_tế , tải dồn . luật_khám , chữa bệnh ( 2009 ) , quy_định dựa , tiêu_chí cơ_sở khám , chữa bệnh phân 4 chuyên_môn kỹ_thuật . luật_khám , chữa bệnh ( sửa_đổi ) thành_lập 3 khám , chữa bệnh mức_độ . căn_cứ khả_năng đáp_ứng cơ_sở người_bệnh bố_trí . bộ_trưởng , quá_tải dồn tuyến , tuyến thành 2 luồng : thứ_nhất , tuyến tuyến , cơ_sở đáp_ứng khám , chữa bệnh người_dân . hai_là , tuyến tuyến , bệnh_tật ổn_định tuyến công_tác điều_trị lâu_dài . việc_này chất_lượng công_tác khám , chữa bệnh điều_trị . , thủ_tục hành_chính , bộ_y_tế chỉ_đạo hình_thức chuyển_tuyến điện_tử hồ_sơ quản_lý sức_khỏe điện_tử . vai trò giấy tuyến , ghi lịch_sử điều_trị , tóm_tắt bệnh_án … tuyến hình_thức giấy điện_tử cần_thiết .",
