     "file_texts": "Răng Kẽm rất cần cho răng khỏe mạnh và cơ thể có lượng kẽm thấp, chúng ta sẽ không có hàm răng trắng bóng, răng có thể dễ dàng bị mẻ và không khỏe.LưỡiNếu bị thiếu kẽm, chúng ta có thể nhận thấy sự\nnhạy cảm với mùi, vị giác thay đổi, rêu lưỡi trắng.Niêm mạc vùng miệngNhiều nghiên cứu đã chỉ ra rằng lượng kẽm thấp có thể làm tăng nguy cơ loét miệng và những bệnh nhân có lượng kẽm thấp thường bị\nnhững đợt loét miệng tái diễn.Mô nha chuNướu dễ bị viêm chảy máu do kẽm tham gia vào quá trình oxy hóa, tăng miễn dịch. Đa phần tình trạng yếu xương không gợi ý bạn nghĩ đến việc thiếu hụt kẽm, song\nnếu bổ sung canxi và dinh dưỡng cho xương khác mà tình trạng bệnh không cải thiện tốt thì cần nghĩ ngay đến loại khoáng chất này bị thiếu.Để bổ sung kẽm cho cơ thể chúng ta có thể ăn một số loại thực\nphẩm như nấm, hạt vừng đen, cải thìa, đậu phộng... Ngoài ra, có một số dấu hiệu của tình trạng thiếu kẽm dễ nhận thấy là rụng tóc, loét miệng, móng tay giòn dễ gãy và có đốm trắng…",
