     "Column1": 74,
     "subject": "Y Tế",
     "title": "Thanh niên 20 tuổi mở van bình nén khí oxy bị bỏng lạnh nặng",
     "author": "HƯƠNG SƠN",
     "file_names": "76.txt",
     "file_texts": "Bệnh nhân V.P.M (20 tuổi, sinh viên, quê Tiền Giang) làm thêm ở tiệm hàn xì của người thân. Buổi tối 3 ngày trước khi nhập Bệnh viện Đa khoa Tâm Anh, trong lúc M vặn van bình nén khí oxy (oxy hóa\nlỏng) để cắt, hàn cửa nhôm kính, bất ngờ khí trong bình xì qua chỗ thủng trên dây dẫn, xịt thẳng vào bàn tay trái. Chỉ trong vài giây, M khóa van lại nhưng bàn tay trái đã lạnh buốt, tê cứng sau đó\nđau rát dữ dội.“Tôi tự sơ cứu bằng cách để tay dưới vòi nước chảy, đắp nha đam để giảm nóng rát. Ngay sau đó, tới phòng khám gần nhà, được bác sĩ kê thuốc uống giảm đau và kháng viêm. Sau 3 ngày, da\nlòng bàn tay trái phồng rộp, nổi bóng nước lớn, mu bàn tay sưng đỏ, đau nhiều, kèm sốt nên đến bệnh viện điều trị”, bệnh nhân M. chia sẻ.Tại bệnh viện, TS.BS Đặng Thị Ngọc Bích, chuyên khoa Da liễu -\nThẩm mỹ da, cho biết, bệnh nhân M. bị bỏng lạnh độ 2, tổn thương da và mô bàn tay trái, diện tích khoảng 5cm.May mắn các mạch máu, gân cơ và dây thần kinh ở bàn tay chưa ảnh hưởng. Người bệnh được\nchọc hút bóng nước, vệ sinh vết thương, bôi thuốc chứa kháng viêm, kháng sinh. Sau 5 ngày, vết bỏng của M. đã ổn định, hết đau rát. Dự kiến sau khoảng 1 tuần nữa vết thương sẽ lành, mọc da non.Theo\nbác sĩ Bích, bỏng lạnh ít gặp hơn so với các loại bỏng khác như bỏng nhiệt, bỏng lửa, bỏng điện, bỏng hóa chất.Bỏng lạnh (hay phỏng lạnh) là tình trạng mô sống ở người bị đông cứng và tổn thương do\ntiếp xúc với nhiệt độ quá thấp (dưới 0 độ C).Các nguyên nhân phổ biến gây bỏng lạnh là tiếp xúc trực tiếp với các loại khí, vòi xịt khí hóa lỏng, như nitơ lỏng, oxy lỏng, CO2 lỏng mà không dùng bảo\nhộ.Các loại khí này được đưa về dạng lỏng (dạng nước), với nhiệt độ âm mạnh (dưới -70 độ C). Ngoài ra, bỏng lạnh có thể gặp khi tiếp xúc với thời tiết lạnh, làm việc trong kho đông lạnh thời gian dài\nnhưng không mặc đồ bảo hộ; tiếp xúc trực tiếp với nước đá, kim loại lạnh, khói giả bằng khí nitơ lạnh trên các sân khấu…Việt Nam là vùng khí hậu nhiệt đới, bỏng lạnh do thời tiết ít gặp hơn, phần lớn\ndo tai nạn trong sinh hoạt, làm việc như anh M.Dấu hiệu bỏng lạnh dễ nhận thấy nhất là cảm giác lạnh buốt, tê tái, bỏng rát, nhói đau như kim châm. Sau đó bề mặt da bắt đầu tái đi và chuyển sang màu\ntrắng, đỏ. Khi vùng da bị bỏng được làm ấm lại, có thể sẽ xuất hiện các bóng nước phồng rộp, sưng phù, da chuyển màu đen, tím, mất cảm giác ở chỗ vết thương.Không nên dùng nước quá nóng hoặc đèn sưởi,\nlửa với nhiệt độ cao để sưởi ấm cho người bị nạn vì có thể gây phản tác dụng, phồng rộp da.Khi da xuất hiện bóng nước, tuyệt đối không được tự bóp, nặn khiến bóng nước vỡ ra. Nhất là không được tự\nđiều trị bằng cách bôi kem đánh răng, nha đam, lòng trắng trứng, hoặc các loại lá cây theo kinh nghiệm dân gian. Quan niệm sai lầm này có thể gây ra nhiễm trùng, nhiễm khuẩn, khiến vết thương nặng\nthêm.",
     "token": "Bệnh_nhân V. P. M ( 20 tuổi , sinh_viên , quê Tiền_Giang ) làm thêm ở tiệm hàn_xì của người_thân . Buổi_tối 3 ngày trước khi nhập Bệnh_viện Đa_khoa Tâm_Anh , trong lúc M_vặn van bình nén khí oxy ( oxy hóa lỏng ) để cắt , hàn cửa nhôm_kính , bất_ngờ khí trong bình xì_qua_chỗ_thủng trên dây dẫn , xịt thẳng vào bàn tay_trái . Chỉ_trong vài giây , M_khóa van lại nhưng bàn_tay trái đã lạnh buốt , tê cứng sau đó đau rát dữ_dội . “_Tôi tự sơ_cứu bằng cách để tay dưới vòi nước chảy , đắp nha đam để giảm nóng rát . Ngay_sau đó , tới phòng_khám gần nhà , được bác_sĩ kê thuốc uống giảm đau và kháng_viêm . Sau_3 ngày , da lòng bàn_tay trái phồng rộp , nổi bóng_nước lớn , mu bàn_tay sưng đỏ , đau nhiều , kèm sốt nên đến bệnh_viện điều_trị ” , bệnh_nhân M. chia_sẻ . Tại_bệnh_viện , TS._BS Đặng_Thị_Ngọc_Bích , chuyên_khoa Da_liễu - Thẩm_mỹ da , cho biết , bệnh_nhân M. bị bỏng lạnh độ 2 , tổn_thương da và mô bàn_tay_trái , diện_tích khoảng 5cm . May_mắn các mạch_máu , gân cơ và dây thần_kinh ở bàn_tay chưa ảnh_hưởng . Người_bệnh được chọc hút bóng_nước , vệ_sinh vết_thương , bôi thuốc chứa kháng_viêm , kháng_sinh . Sau_5 ngày , vết bỏng của M. đã ổn_định , hết đau rát . Dự_kiến sau khoảng 1 tuần nữa vết_thương sẽ lành , mọc da non . Theo_bác sĩ_Bích , bỏng lạnh ít gặp hơn so với các loại bỏng khác như bỏng nhiệt , bỏng lửa , bỏng điện , bỏng hóa_chất . Bỏng lạnh ( hay phỏng lạnh ) là tình_trạng mô sống ở người bị đông cứng và tổn_thương do tiếp_xúc với nhiệt_độ quá thấp ( dưới 0 độ C ) . Các nguyên_nhân phổ_biến gây bỏng lạnh là tiếp_xúc trực_tiếp với các loại_khí , vòi xịt khí hóa lỏng , như nitơ lỏng , oxy lỏng , CO2_lỏng mà không dùng bảo_hộ . Các_loại khí này được đưa về dạng lỏng ( dạng nước ) , với nhiệt_độ âm_mạnh ( dưới - 70 độ C ) . Ngoài_ra , bỏng lạnh có_thể gặp khi tiếp_xúc với thời_tiết lạnh , làm_việc trong kho đông_lạnh thời_gian dài nhưng không mặc đồ bảo_hộ ; tiếp_xúc trực_tiếp với nước_đá , kim_loại lạnh , khói giả bằng khí nitơ lạnh trên các sân_khấu … Việt_Nam là vùng khí_hậu nhiệt_đới , bỏng lạnh do thời_tiết ít gặp hơn , phần_lớn do tai_nạn trong sinh_hoạt , làm_việc như anh M._Dấu hiệu bỏng lạnh dễ nhận thấy nhất là cảm_giác lạnh_buốt , tê_tái , bỏng rát , nhói đau như kim châm . Sau_đó bề_mặt da bắt_đầu tái đi và chuyển sang màu trắng , đỏ . Khi vùng da bị bỏng được làm ấm lại , có_thể sẽ xuất_hiện các bóng_nước phồng rộp , sưng phù , da chuyển màu đen , tím , mất cảm_giác ở chỗ vết_thương . Không_nên dùng nước quá nóng hoặc đèn_sưởi , lửa với nhiệt_độ cao để sưởi ấm cho người bị nạn vì có_thể gây phản_tác_dụng , phồng rộp da . Khi_da xuất_hiện bóng_nước , tuyệt_đối không được tự_bóp , nặn khiến bóng_nước vỡ ra . Nhất_là không được tự điều_trị bằng cách bôi kem đánh răng , nha đam , lòng trắng trứng , hoặc các loại lá cây theo kinh_nghiệm dân_gian . Quan_niệm sai_lầm này có_thể gây ra nhiễm_trùng , nhiễm_khuẩn , khiến vết_thương nặng thêm .",
