     "Column1": 75,
     "subject": "Y Tế",
     "title": "Số ca mắc bệnh hô hấp gia tăng ở Trung Quốc, Bộ Y tế đề nghị cung cấp thông tin",
     "author": "Lệ Hà",
     "file_names": "77.txt",
     "file_texts": "Theo đó, Cục Y tế dự phòng (Cơ quan Đầu mối thực hiện IHR Việt Nam) đã liên hệ, trao đổi trực tiếp với đại diện WHO tại Việt Nam và Cơ quan Đầu mối thực hiện IHR Trung Quốc đề nghị phối hợp, cung cấp\ncác thông tin liên quan về sự gia tăng trường hợp mắc các bệnh hô hấp ở Trung Quốc.Cục Y tế dự phòng cho biết, Cục đã liên hệ, trao đổi trực tiếp với đại diện WHO tại Việt Nam và Cơ quan Đầu mối thực\nhiện IHR Trung Quốc đề nghị phối hợp, cung cấp các thông tin liên quan.Ngày 23.11, Cục Y tế dự phòng đã có thư gửi đại điện WHO và Văn phòng CDC Hoa Kỳ tại Việt Nam đề nghị cung cấp thông tin chính\nthức liên quan đến việc gia tăng các trường hợp mắc bệnh đường hô hấp tại Trung Quốc.Cục Y tế dự phòng cho biết sẽ tiếp tục phối hợp chặt chẽ với WHO, CDC Hoa Kỳ và các tổ chức quốc tế cập nhật thông\ntin về tình hình dịch bệnh đường hô hấp tại Trung Quốc và đề xuất các biện pháp phòng, chống dịch phù hợp để báo cáo Lãnh đạo Bộ Y tế. Đồng thời phối hợp với các đơn vị liên quan tăng cường công tác\ntruyền thông, khuyến cáo người dân không chủ quan, lơ là nhưng cũng không hoang mang, lo lắng và chủ động thực hiện các biện pháp phòng bệnh cá nhân, các khuyến cáo phòng bệnh lây truyền qua đường hô\nhấp.Theo cập nhật đến ngày 23.11, trên trang thông tin điện tử của WHO cho biết, ngày 13.11.2013, Ủy ban Y tế Quốc gia Trung Quốc thông báo về sự gia tăng số trường hợp mắc các bệnh về đường hô hấp\ntại Trung Quốc và nhận định nguyên nhân là do việc dỡ bỏ các chính sách hạn chế liên quan đến COVID-19 và sự lây lan của các mầm bệnh đường hô hấp như cúm, mycoplasma pneumoniae (vi khuẩn gây viêm\nphổi phổ biến ở trẻ em), virus hợp bào hô hấp (RSV) và virus SARS-CoV-2.Ngày 21.11, Chương trình theo dõi các bệnh mới nổi (ProMED) có thông báo về các chùm ca bệnh viêm phổi chưa rõ nguyên nhân ở trẻ\nem xảy ra tại miền Bắc Trung Quốc.Hiện chưa xác định được mối liên quan giữa các chùm ca bệnh viêm phổi chưa rõ nguyên nhân ở trẻ em này với tình trạng gia tăng số trường hợp mắc các bệnh về đường hô\nhấp tại Trung Quốc nêu trên.",
     "token": "Theo_đó , Cục_Y_tế_dự_phòng ( Cơ_quan_Đầu_mối thực_hiện IHR Việt_Nam ) đã liên_hệ , trao_đổi trực_tiếp với đại_diện WHO tại Việt_Nam và Cơ_quan Đầu_mối thực_hiện IHR Trung_Quốc đề_nghị phối_hợp , cung_cấp các thông_tin liên_quan về sự gia_tăng trường_hợp mắc các bệnh hô_hấp ở Trung_Quốc . Cục_Y_tế dự_phòng cho_biết , Cục đã liên_hệ , trao_đổi trực_tiếp với đại_diện WHO tại Việt_Nam và Cơ_quan Đầu_mối thực_hiện IHR Trung_Quốc đề_nghị phối_hợp , cung_cấp các thông_tin liên_quan . Ngày_23.11 , Cục_Y_tế dự_phòng đã có thư gửi đại_điện_WHO và Văn_phòng CDC Hoa_Kỳ tại Việt_Nam đề_nghị cung_cấp thông_tin chính_thức liên_quan đến việc gia_tăng các trường_hợp mắc bệnh đường hô_hấp tại Trung_Quốc . Cục_Y_tế dự_phòng cho biết sẽ tiếp_tục phối_hợp chặt_chẽ với WHO , CDC Hoa_Kỳ và các tổ_chức quốc_tế cập_nhật thông_tin về tình_hình dịch_bệnh đường hô_hấp tại Trung_Quốc và đề_xuất các biện_pháp phòng , chống dịch phù_hợp để báo_cáo Lãnh_đạo Bộ_Y_tế . Đồng_thời phối_hợp với các đơn_vị liên_quan tăng_cường công_tác truyền_thông , khuyến_cáo người_dân không chủ_quan , lơ_là nhưng cũng không hoang_mang , lo_lắng và chủ_động thực_hiện các biện_pháp phòng_bệnh cá_nhân , các khuyến_cáo phòng_bệnh lây_truyền qua đường hô_hấp . Theo_cập nhật đến ngày 23.11 , trên trang thông_tin điện_tử của WHO cho biết , ngày 13.11.2013 , Ủy_ban Y_tế Quốc_gia Trung_Quốc thông_báo về sự gia_tăng số trường_hợp mắc các bệnh về đường hô_hấp tại Trung_Quốc và nhận_định nguyên_nhân là do việc dỡ bỏ các chính_sách hạn_chế liên_quan đến COVID - 19 và sự lây_lan của các mầm bệnh đường hô_hấp như cúm , mycoplasma pneumoniae ( vi_khuẩn gây viêm phổi phổ_biến ở trẻ_em ) , virus hợp bào hô_hấp ( RSV ) và virus SARS - CoV - 2 . Ngày_21.11 , Chương_trình theo_dõi các bệnh mới nổi ( ProMED ) có thông_báo về các chùm ca bệnh viêm phổi chưa rõ nguyên_nhân ở trẻ_em xảy ra tại miền Bắc_Trung_Quốc . Hiện chưa xác_định được mối liên_quan giữa các chùm ca bệnh viêm phổi chưa rõ nguyên_nhân ở trẻ_em này với tình_trạng gia_tăng số trường_hợp mắc các bệnh về đường hô_hấp tại Trung_Quốc nêu trên .",
