     "Column1": 77,
     "subject": "Y Tế",
     "title": "Tác nhân gây viêm hô hấp ở trẻ em hiện nay là nhóm các virus thường gặp",
     "author": "Vinh Phú",
     "file_names": "79.txt",
     "file_texts": "Hệ thống giám sát dịch bệnh của TPHCM trong những tháng gần đây đã ghi nhận tình trạng gia tăng số ca mắc viêm hô hấp cấp tính ở trẻ em. Đây là nhóm bệnh thường gặp nhất ở trẻ em, diễn tiến theo mùa,\nthường tăng cao vào tháng 10-12 hàng năm.Số liệu ghi nhận trong 10 tháng đầu năm 2023 cho thấy, bệnh nhi bị viêm hô hấp cấp điều trị ngoại trú, nội trú và tử vong đều thấp hơn cùng kỳ so với các năm\ntrước dịch COVID-19.Theo Trung tâm Kiểm soát bệnh tật TPHCM, mặc dù số ca đến khám tại các cơ sở y tế có gia tăng trong những tháng cuối năm 2023, nhưng hệ thống giám sát chưa ghi nhận các ổ dịch viêm\nhô hấp tại các trường học. Điều này phù hợp với độ tuổi mắc bệnh đợt này chủ yếu ở trẻ nhỏ.Được biết, ngày 20.11.2023, Sở Y tế TPHCM đã tổ chức cuộc họp chuyên gia giữa 3 bệnh viện nhi gồm: Bệnh viện\nBệnh Nhiệt đới, Đơn vị Nghiên cứu lâm sàng Đại học Oxford (OUCRU) và Trung tâm Kiểm soát bệnh tật Thành phố để đánh giá nguyên nhân của hiện tượng tăng số ca mắc viêm hô hấp cấp ở trẻ em.Theo kết quả\nxét nghiệm của Đơn vị Nghiên cứu lâm sàng Đại học Oxford từ các mẫu bệnh phẩm thu nhận từ các bệnh viện nhi của TPHCM cho thấy, họ Enterovirus và Human Rhinovirus là các tác nhân gây bệnh chiếm ưu\nthế; kế đến là các virus cúm (influenza) và á cúm (parainfluenza), virus hô hấp hợp bào (RSV)... Đây là các tác nhân gây bệnh hô hấp thường gặp ở trẻ em trong nhiều năm qua.Các chuyên gia về bệnh hô\nhấp trẻ em đã nhận định các virus này đều là những tác nhân phổ biến gây bênh viêm hô hấp, đã được ghi nhận tại Việt Nam và trên thế giới. Phần lớn ca bệnh đều nhẹ, có thể điều trị ngoại trú.Các\nchuyên gia cũng lưu ý, các bệnh cảnh viêm phổi thường gặp trên người bệnh có ít nhất 1 bệnh lý nền như: tim bẩm sinh, bại não, xuất huyết não, teo đường mật, suy giảm miễn dịch, bệnh phổi mạn tính,\nbệnh lupus đỏ hệ thống, suy dinh dưỡng…",
     "token": "Hệ_thống giám_sát dịch_bệnh của TPHCM trong những tháng gần đây đã ghi_nhận tình_trạng gia_tăng số ca mắc viêm hô_hấp cấp_tính ở trẻ_em . Đây_là nhóm bệnh thường gặp nhất ở trẻ_em , diễn_tiến theo mùa , thường tăng cao vào tháng 10 - 12 hàng năm . Số_liệu ghi_nhận trong 10 tháng đầu năm 2023 cho thấy , bệnh_nhi bị viêm hô_hấp cấp điều_trị ngoại_trú , nội_trú và tử_vong đều thấp hơn cùng kỳ so với các năm trước dịch_COVID - 19 . Theo_Trung tâm Kiểm_soát bệnh_tật TPHCM , mặc_dù số ca đến khám tại các cơ_sở y_tế có gia_tăng trong những tháng cuối năm 2023 , nhưng hệ_thống giám_sát chưa ghi_nhận các ổ dịch viêm hô_hấp tại các trường_học . Điều_này phù_hợp với độ tuổi mắc bệnh đợt này chủ_yếu ở trẻ nhỏ . Được_biết , ngày 20.11.2023 , Sở_Y_tế TPHCM đã tổ_chức cuộc họp chuyên_gia giữa 3 bệnh_viện nhi gồm : Bệnh_viện Bệnh_Nhiệt_đới , Đơn_vị Nghiên_cứu lâm_sàng Đại_học Oxford ( OUCRU ) và Trung_tâm Kiểm_soát bệnh_tật Thành_phố để đánh_giá nguyên_nhân của hiện_tượng tăng số ca mắc viêm hô_hấp cấp ở trẻ_em . Theo_kết quả xét_nghiệm của Đơn_vị Nghiên_cứu lâm_sàng Đại_học Oxford từ các mẫu bệnh_phẩm thu_nhận từ các bệnh_viện nhi của TPHCM cho thấy , họ Enterovirus và Human_Rhinovirus là các tác_nhân gây bệnh chiếm ưu_thế ; kế đến là các virus cúm ( influenza ) và á cúm ( parainfluenza ) , virus hô_hấp hợp_bào ( RSV ) ... Đây_là các tác_nhân gây bệnh hô_hấp thường gặp ở trẻ_em trong nhiều năm qua . Các chuyên_gia về bệnh hô_hấp trẻ_em đã nhận_định các virus này đều là những tác_nhân phổ_biến gây bênh viêm hô_hấp , đã được ghi_nhận tại Việt_Nam và trên thế_giới . Phần_lớn ca bệnh đều nhẹ , có_thể điều_trị ngoại_trú . Các chuyên_gia cũng lưu_ý , các bệnh_cảnh viêm phổi thường gặp trên người_bệnh có ít_nhất 1 bệnh_lý nền như : tim bẩm_sinh , bại_não , xuất_huyết não , teo đường mật , suy_giảm miễn_dịch , bệnh phổi mạn_tính , bệnh lupus_đỏ hệ_thống , suy_dinh_dưỡng …",
