     "file_texts": "Theo lời kể của người bệnh N.A.T (21 tuổi, ở Nghệ An) trong quá trình lao động, anh sơ ý để máy cắt cỏ cắt lìa bàn chân. Anh được chuyển đến Bệnh viện Đa khoa tỉnh Nghệ An để sơ cứu và sau đó, bệnh\nnhân được chuyển đến Bệnh viện Trung ương Quân đội 108.Tại Bệnh viện Trung ương Quân đội 108, các bác sĩ đã trồng bàn chân đứt rời bằng kĩ thuật vi phẫu dưới kính hiển vi phẫu thuật. Ca phẫu thuật kéo\ndài 5 giờ, các cấu trúc mạch máu, thần kinh, gân cơ được phục hồi lại.TS.BS Nguyễn Quang Vịnh, khoa Chấn thương chi trên và Vi phẫu, Viện Chấn thương chỉnh hình (Bệnh viện Trung ương Quân đội 108)\nkhuyến cáo người dân khi sử dụng máy cắt cỏ phải kiểm tra tình trạng máy trước khi sử dụng. Đa số các tai nạn là do lưỡi cắt bị văng ra ngoài, quá trình sử dụng máy phải đi giầy bảo hộ và giữ tập\ntrung trong quá trình lao động.Bác sĩ Vịnh cũng khuyến cáo, thời gian vàng lý tưởng để nối chi thể bị đứt rời là 6 giờ tính từ lúc bị đứt đến lúc các bác sĩ thực hiện nối lại mạch cấp máu cho phần chi\nthể đứt rời, nếu chi thể được bảo quản đúng cách.Với phần chi đứt lìa, người sơ cứu rửa bằng nước sạch (nước đun sôi để nguội) hoặc nước muối sinh lý. Không được rửa bằng xà phòng hoặc hóa chất. Sau\nđó, phần chi thể đứt lìa được bọc kín bằng gạc hoặc vải sạch (chú ý không bọc quá dày) rồi cho vào túi ni lông, buộc kín miệng túi để nước không thấm vào.Đặt túi vào thùng nước đá lạnh, thau chứa nước\nđá lạnh, hoặc đơn giản nhất là cho vào trong một túi nhựa khác có chứa nước đá lạnh. Mục đích của quấn băng vải quanh phần chi đứt lìa là để chi không tiếp xúc trực tiếp với đá lạnh.",
     "token": "Theo_lời kể của người bệnh N._A. T ( 21 tuổi , ở Nghệ_An ) trong quá_trình lao_động , anh sơ_ý để máy cắt cỏ cắt lìa bàn_chân . Anh được chuyển đến Bệnh_viện Đa_khoa tỉnh Nghệ_An để sơ_cứu và sau đó , bệnh_nhân được chuyển đến Bệnh_viện Trung_ương Quân_đội 108 . Tại_Bệnh viện Trung_ương Quân_đội 108 , các bác_sĩ đã trồng bàn_chân đứt rời bằng kĩ_thuật vi_phẫu dưới kính_hiển_vi phẫu_thuật . Ca_phẫu_thuật kéo_dài 5 giờ , các cấu_trúc mạch_máu , thần_kinh , gân_cơ được phục_hồi lại . TS._BS Nguyễn_Quang_Vịnh , khoa Chấn_thương chi trên và Vi_phẫu , Viện_Chấn thương chỉnh_hình ( Bệnh_viện Trung_ương Quân_đội 108 ) khuyến_cáo người_dân khi sử_dụng máy cắt cỏ phải kiểm_tra tình_trạng máy trước khi sử_dụng . Đa_số các tai_nạn là do lưỡi cắt bị văng ra ngoài , quá_trình sử_dụng máy phải đi giầy_bảo_hộ và giữ tập_trung trong quá_trình lao_động . Bác_sĩ_Vịnh cũng khuyến_cáo , thời_gian vàng lý_tưởng để nối chi_thể bị đứt rời là 6 giờ tính từ lúc bị đứt đến lúc các bác_sĩ thực_hiện nối lại mạch cấp máu cho phần chi_thể đứt rời , nếu chi_thể được bảo_quản đúng cách . Với_phần chi đứt lìa , người sơ_cứu rửa bằng nước_sạch ( nước đun sôi để nguội ) hoặc nước muối sinh_lý . Không được rửa bằng xà_phòng hoặc hóa_chất . Sau_đó , phần chi_thể đứt lìa được bọc kín bằng gạc hoặc vải sạch ( chú_ý không bọc quá dày ) rồi cho vào túi ni_lông , buộc kín miệng túi để nước không thấm vào . Đặt_túi vào thùng nước đá lạnh , thau chứa nước đá lạnh , hoặc đơn_giản nhất là cho vào trong một túi nhựa khác có chứa nước đá lạnh . Mục_đích của quấn băng vải quanh phần chi đứt lìa là để chi không tiếp_xúc trực_tiếp với đá lạnh .",
     "remove_stopword": "theo_lời bệnh n._a. t ( 21 , nghệ_an ) lao_động , sơ_ý máy cắt cỏ cắt lìa bàn_chân . bệnh_viện đa_khoa tỉnh nghệ_an sơ_cứu , bệnh_nhân bệnh_viện trung_ương quân_đội 108 . tại_bệnh viện trung_ương quân_đội 108 , bác_sĩ trồng bàn_chân đứt rời kĩ_thuật vi_phẫu kính_hiển_vi phẫu_thuật . ca_phẫu_thuật kéo_dài 5 , cấu_trúc mạch_máu , thần_kinh , gân_cơ phục_hồi . ts._bs nguyễn_quang_vịnh , khoa chấn_thương chi vi_phẫu , viện_chấn thương chỉnh_hình ( bệnh_viện trung_ương quân_đội 108 ) khuyến_cáo người_dân máy cắt cỏ kiểm_tra máy . đa_số tai_nạn lưỡi cắt văng , máy đi giầy_bảo_hộ lao_động . bác_sĩ_vịnh khuyến_cáo , vàng lý_tưởng nối chi_thể đứt rời 6 đứt bác_sĩ nối mạch máu chi_thể đứt rời , chi_thể bảo_quản . với_phần chi đứt lìa , sơ_cứu rửa nước_sạch ( đun sôi nguội ) muối sinh_lý . rửa xà_phòng hóa_chất . , chi_thể đứt lìa bọc kín gạc vải sạch ( chú_ý bọc dày ) túi ni_lông , buộc kín miệng túi thấm . đặt_túi thùng đá lạnh , thau chứa đá lạnh , đơn_giản túi nhựa chứa đá lạnh . mục_đích quấn băng vải quanh chi đứt lìa chi tiếp_xúc đá lạnh .",
