     "file_texts": "“Sáng hôm nay (23.11) người nhà đã đưa cháu lại xét nghiệm máu, tình trạng sức khỏe cháu đã ổn định bớt sưng và đau”, ông Khái cho hay.Trước đó, vào khoảng 19h30 ngày 22.11, bé N.T.Đ (2 tuổi, ngụ xã\nHàm Ninh) được người nhà phát hiện có dấu hiệu bị rắn cắn ở chân. Khoảng 20h30 Phòng Khám Đa Khoa S.O.S Phú Quốc đã tiếp nhận cháu trong tình trạng đau nhức và sưng nhiều ở vùng vết cắn. Các bác sĩ\ntrực đã nhận dạng được vết thương do rắn lục đuôi đỏ cắn và tiến hành sơ cứu, tiêm huyết thanh, dùng thuốc kháng sinh, kháng viêm, giảm đau. Theo dõi đến khoảng 23h thấy dấu hiệu ổn định nên bác sĩ\ncho về theo dõi tiếp.Phòng khám cũng nhắc người nhà quay lại sớm nhất vào ngày hôm sau để xét nghiệm máu kiểm tra lại. Ông Khái cũng lưu ý các bậc phụ huynh khi trẻ nhỏ bị rắn cắn không thể diễn tả\nđược màu sắc của rắn vẫn phải hết sức bình tĩnh đưa bé đến ngay cơ sở y tế gần nhất có huyết thanh.“Đối với các trường hợp không thể diễn tả được loại rắn, côn trùng tấn công sẽ được chăm sóc bởi đội\nngũ bác sĩ và điều dưỡng đã có kinh nghiệm xử lý nhiều ca rắn cắn cũng như được đào tạo cập nhật hàng năm, hội ý từ xa với Trại rắn Đồng Tâm và Trung tâm Chống độc”, ông Khái cho biết thêm.Ông Khái\ncũng khuyến cáo các gia đình có trẻ nhỏ nên cẩn trọng dọn dẹp bụi rậm, hoặc cắt tỉa cỏ, cây xung quanh nhà. Khi trẻ bị rắn cắn, cần bình tĩnh sơ cứu đúng cách, không làm trẻ hoảng sợ. Tuyệt đối không\nbóp, nặn hoặc bôi thuốc vào vết cắn và nhanh chóng đưa đến cơ sở y tế gần nhất để được cấp cứu kịp thời.",
     "token": "“ Sáng hôm_nay ( 23.11 ) người_nhà đã đưa cháu lại xét_nghiệm máu , tình_trạng sức_khỏe cháu đã ổn_định bớt sưng và đau ” , ông Khái cho_hay . Trước_đó , vào_khoảng 19h30 ngày 22.11 , bé N._T. Đ ( 2 tuổi , ngụ xã Hàm_Ninh ) được người_nhà phát_hiện có dấu_hiệu bị rắn cắn ở chân . Khoảng_20h30 Phòng_Khám_Đa Khoa_S. O. S Phú_Quốc đã tiếp_nhận cháu trong tình_trạng đau nhức và sưng nhiều ở vùng vết cắn . Các bác_sĩ trực đã nhận_dạng được vết_thương do rắn lục đuôi đỏ cắn và tiến_hành sơ_cứu , tiêm huyết_thanh , dùng thuốc kháng_sinh , kháng_viêm , giảm đau . Theo_dõi đến khoảng 23h thấy dấu_hiệu ổn_định nên bác_sĩ cho về theo_dõi tiếp . Phòng_khám cũng nhắc người_nhà quay lại sớm nhất vào ngày hôm sau để xét_nghiệm máu kiểm_tra lại . Ông_Khái cũng lưu_ý các bậc phụ_huynh khi trẻ nhỏ bị rắn cắn không_thể diễn_tả được màu_sắc của rắn vẫn phải hết_sức bình_tĩnh đưa bé đến ngay cơ_sở y_tế gần nhất có huyết_thanh . “ Đối_với các trường_hợp không_thể diễn_tả được loại rắn , côn_trùng tấn_công sẽ được chăm_sóc bởi đội_ngũ bác_sĩ và điều_dưỡng đã có kinh_nghiệm xử_lý nhiều ca rắn cắn cũng như được đào_tạo cập_nhật hàng năm , hội_ý từ xa với Trại_rắn Đồng_Tâm và Trung_tâm Chống_độc_” , ông Khái cho biết thêm . Ông_Khái cũng khuyến_cáo các gia_đình có trẻ nhỏ nên cẩn_trọng dọn_dẹp bụi rậm , hoặc cắt tỉa cỏ , cây xung_quanh nhà . Khi_trẻ bị rắn cắn , cần bình_tĩnh sơ_cứu đúng cách , không làm trẻ hoảng_sợ . Tuyệt_đối không bóp , nặn hoặc bôi thuốc vào vết cắn và nhanh_chóng đưa đến cơ_sở y_tế gần nhất để được cấp_cứu kịp_thời .",
