     "Column1": 85,
     "subject": "Y Tế",
     "title": "TPHCM hết nhiều loại vaccine tiêm chủng cho trẻ em",
     "author": "HƯƠNG SƠN",
     "file_names": "86.txt",
     "file_texts": "Liên quan đến vấn đề hết vaccine tại TPHCM, phóng viên Báo Lao Động đã có ghi nhận tại Trạm Y tế Phường 8, quận Gò Vấp về tình hình tiêm chủng tại đây.Từ cuối tháng 9.2023, cơ sở này chỉ còn 3 loại\nvaccine là viêm não Nhật Bản, sởi, Rubela cho trẻ 5 tháng tuổi; vaccine 5 trong 1 và nhiều loại vaccine khác đều hết.Bác sĩ Trần Hoàng Hà - Trưởng Trạm Y tế Phường 8, quận Gò Vấp - cho biết, \"Trong\ntình hình vaccine hiện nay đã cạn kiệt ở nhiều cơ sở y tế trên địa bàn TPHCM, nên khi phụ huynh đưa con đến đây tiêm chủng, chúng tôi chỉ còn cách hướng dẫn đưa đến các cơ sở tiêm chủng tư nhân có trả\nphí\".Hiện nay, Trạm Y tế Phường 8, quận Gò Vấp đang quản lý hàng trăm trẻ em trong độ tuổi tiêm chủng. Trong đó, có 286 trẻ 1 tuổi cần được tiêm nhiều mũi, nhưng cũng cạn nguồn vaccine để tiêm.“Bản\nthân chúng tôi cũng không biết khi nào mới có nguồn vaccine tiêm chủng mở rộng phân bổ về. Việc liên tục thiếu vaccine khiến công tác tiêm chủng và tạo hệ miễn dịch cho trẻ bị gián đoạn.Thông thường,\ndịch bệnh sẽ bùng lên trong vòng 3 năm sau nếu tỉ lệ tiêm chủng bao phủ thấp. Hiện trong chương trình tiêm chủng mở rộng có 12 loại vaccine được triển khai tiêm cho trẻ miễn phí, nên rất hy vọng tình\nhình thiếu vaccine nhanh chóng được khắc phục”, bác sĩ Hoàng Hà cho biết.Trước những thông tin về việc hết vaccine trong chương trình tiêm chủng mở rộng, Phòng Nghiệp vụ Dược và HCDC cho biết, tính\nđến hết ngày 21.11.2023, trên địa bàn TPHCM đã không còn các vaccine DPT, IPV (bại liệt tiêm), VGB, SII (DPT-VGB-Hib). Các vaccine khác còn lại rất ít, chỉ đủ dùng trong một hoặc vài ngày tới là sởi,\nbOPV, BCG, MR, uốn ván, viêm não Nhật Bản.Trước đó, từ tình hình thiếu hụt vaccine Chương trình tiêm chủng mở rộng, Sở Y tế TPHCM đã tham mưu UBND TPHCM có văn bản báo cáo và đề nghị Bộ Y tế khẩn\ntrương phân bổ vaccine, đáp ứng nhu cầu tiêm chủng cho người dân trên địa bàn.Ngày 27.10.2023, Bộ Y tế đã có công văn 6894\/KH-TC phúc đáp kiến nghị của UBND TPHCM, công văn nêu rõ: “Trong thời gian\nqua, Bộ Y tế đã tập trung giải quyết các khó khăn, vướng mắc và đang tiến hành mua sắm vaccine. Sau khi có kết quả mua sắm, Viện Vệ sinh dịch tễ Trung ương sẽ tiến hành phân bổ cho TPHCM và các địa\nphương trong thời gian sớm nhất”.Được biết, với Nghị quyết số 98\/NQ-CP ngày 10.7.2023 của Chính phủ về việc bố trí ngân sách Trung ương năm 2023 cho Bộ Y tế để mua vaccine cho chương trình tiêm chủng\nmở rộng và Quyết định số 931\/QĐ-TTg ngày 05.8.2023 của Thủ tướng Chính phủ về việc bổ sung dự toán năm 2023 của Bộ Y tế để mua vaccine trong Chương trình tiêm chủng mở rộng, Bộ Y tế đã và đang tiến\nhành đàm phán giá đối với vaccine sản xuất trong nước và đấu thầu mua sắm vaccine nhập khẩu.",
     "token": "Liên_quan đến vấn_đề hết vaccine tại TPHCM , phóng_viên Báo_Lao_Động đã có ghi_nhận tại Trạm_Y tế_Phường 8 , quận Gò_Vấp về tình_hình tiêm_chủng tại đây . Từ_cuối tháng 9.2023 , cơ_sở này chỉ còn 3 loại vaccine là viêm não Nhật_Bản , sởi , Rubela cho trẻ 5 tháng tuổi ; vaccine 5 trong 1 và nhiều loại vaccine khác đều hết . Bác_sĩ Trần_Hoàng_Hà - Trưởng_Trạm Y_tế Phường 8 , quận Gò_Vấp - cho biết , \" Trong_tình_hình vaccine hiện_nay đã cạn_kiệt ở nhiều cơ_sở y_tế trên địa_bàn TPHCM , nên khi phụ_huynh đưa con đến đây tiêm_chủng , chúng_tôi chỉ còn cách hướng_dẫn đưa đến các cơ_sở tiêm_chủng tư_nhân có trả phí \" . Hiện_nay , Trạm_Y tế_Phường 8 , quận Gò_Vấp đang quản_lý hàng trăm trẻ_em trong độ tuổi tiêm_chủng . Trong đó , có 286 trẻ 1 tuổi cần được tiêm nhiều mũi , nhưng cũng cạn nguồn vaccine để tiêm . “ Bản_thân chúng_tôi cũng không biết khi nào mới có nguồn vaccine tiêm_chủng mở_rộng phân_bổ về . Việc_liên_tục thiếu vaccine khiến công_tác_tiêm_chủng và tạo hệ miễn_dịch cho trẻ bị gián_đoạn . Thông_thường , dịch_bệnh sẽ bùng lên trong vòng 3 năm sau nếu tỉ_lệ tiêm_chủng bao_phủ thấp . Hiện trong chương_trình tiêm_chủng mở_rộng có 12 loại vaccine được triển_khai tiêm cho trẻ miễn_phí , nên rất hy_vọng tình_hình thiếu vaccine nhanh_chóng được khắc_phục ” , bác_sĩ Hoàng_Hà cho biết . Trước_những thông_tin về việc hết vaccine trong chương_trình tiêm_chủng mở_rộng , Phòng_Nghiệp vụ Dược và HCDC cho biết , tính đến hết ngày 21.11.2023 , trên địa_bàn TPHCM đã không còn các vaccine DPT , IPV ( bại_liệt tiêm ) , VGB , SII ( DPT - VGB - Hib ) . Các vaccine khác còn lại rất ít , chỉ đủ dùng trong một hoặc vài ngày tới là sởi , bOPV , BCG , MR , uốn ván , viêm não Nhật_Bản . Trước_đó , từ tình_hình thiếu_hụt vaccine Chương_trình tiêm_chủng mở_rộng , Sở_Y tế TPHCM đã tham_mưu UBND_TPHCM có văn_bản báo_cáo và đề_nghị Bộ_Y_tế khẩn_trương phân_bổ vaccine , đáp_ứng nhu_cầu tiêm_chủng cho người_dân trên địa_bàn . Ngày_27.10.2023 , Bộ_Y_tế đã có công_văn_6894 \/ KH - TC_phúc đáp kiến_nghị của UBND_TPHCM , công_văn nêu rõ : “_Trong thời_gian qua , Bộ_Y_tế đã tập_trung giải_quyết các khó_khăn , vướng_mắc và đang tiến_hành mua_sắm vaccine . Sau_khi có kết_quả mua_sắm , Viện_Vệ_sinh dịch_tễ Trung_ương sẽ tiến_hành phân_bổ cho TPHCM và các địa_phương trong thời_gian sớm nhất ” . Được_biết , với Nghị_quyết số 98 \/ NQ - CP ngày 10.7.2023 của Chính_phủ về việc bố_trí ngân_sách Trung_ương năm 2023 cho Bộ_Y_tế để mua vaccine cho chương_trình tiêm_chủng mở_rộng và Quyết_định số 931 \/ QĐ - TTg ngày 05.8.2023 của Thủ_tướng Chính_phủ về việc bổ_sung dự_toán năm_2023 của Bộ_Y_tế để mua vaccine trong Chương_trình_tiêm_chủng mở_rộng , Bộ_Y_tế đã và đang tiến_hành đàm_phán giá đối_với vaccine sản_xuất trong nước và đấu_thầu mua_sắm vaccine nhập_khẩu .",
