     "Column1": 87,
     "subject": "Y Tế",
     "title": "Hệ thống bệnh viện công ở Gia Lai gặp khó khi tự chủ tài chính",
     "author": "THANH TUẤN",
     "file_names": "88.txt",
     "file_texts": "Trong giai đoạn 2019-2021, ngành Y tế Gia Lai có 4 đơn vị tự bảo đảm toàn bộ chi phí hoạt động chi thường xuyên, 21 đơn vị tự bảo đảm một phần chi thường xuyên, 2 đơn vị do ngân sách nhà nước bảo đảm\ntoàn bộ chi phí hoạt động chi thường xuyên.Theo ông Lý Minh Thái - Phó Giám đốc Sở Y tế tỉnh Gia Lai, việc thực hiện cơ chế tự chủ tài chính đã tạo quyền chủ động cho các đơn vị trong việc quản lý chi\ntiêu tài chính, từng bước giảm bớt sự can thiệp của cơ quan quản lý. Tuy nhiên, bên cạnh thuận lợi thì vẫn còn một số vướng mắc, khó khăn như cơ sở vật chất một số đơn vị xuống cấp, trang thiết bị kỹ\nthuật cao còn thiếu và bác sĩ chuyên khoa sâu còn thiếu.Một số trung tâm y tế huyện thiếu các thiết bị y tế kỹ thuật cao như: siêu âm màu, X-quang kỹ thuật số, máy xét nghiệm sinh hóa tự động… nên\nkhông thu hút được bệnh nhân, nguồn thu của đơn vị giảm. Thanh toán bảo hiểm y tế còn chậm, đặc biệt là phần vượt trần, vượt quỹ khám chữa bệnh bảo hiểm y tế.Do dịch COVID-19, trong giai đoạn\n2020-2021, số lượng người đến khám chữa bệnh tại các cơ sở y tế công lập giảm đáng kể, dẫn đến các đơn vị thiếu hụt nguồn thu. Kinh phí thiếu hụt của hệ bệnh viện trong năm 2022 là hơn 72 tỉ đồng.Tại\nBệnh viện Đa khoa tỉnh Gia Lai, trong giai đoạn giãn cách xã hội do đại dịch COVID-19 bùng phát, công suất sử dụng giường bệnh giảm sâu, nguồn thu giảm mạnh. Vì vậy, chênh lệch thu chi của Bệnh viện\nĐa khoa tỉnh giai đoạn này âm gần 67 tỉ đồng. Lương thấp, chế độ đãi ngộ không hấp dẫn nên từ đầu năm 2023 đến nay đã có gần 40 bác sĩ, nhân viên y tế của bệnh viện này bỏ việc, nghỉ việc.",
     "token": "Trong_giai đoạn_2019 - 2021 , ngành Y_tế Gia_Lai có 4 đơn_vị tự bảo_đảm toàn_bộ chi_phí hoạt_động chi thường_xuyên , 21 đơn_vị tự bảo_đảm một phần chi thường_xuyên , 2 đơn_vị do ngân_sách nhà_nước bảo_đảm toàn_bộ chi_phí hoạt_động chi thường_xuyên . Theo_ông Lý_Minh_Thái - Phó_Giám_đốc_Sở_Y_tế tỉnh Gia_Lai , việc thực_hiện cơ_chế tự_chủ tài_chính đã tạo quyền chủ_động cho các đơn_vị trong việc quản_lý chi_tiêu tài_chính , từng bước_giảm bớt sự can_thiệp của cơ_quan quản_lý . Tuy_nhiên , bên cạnh thuận_lợi thì vẫn còn một_số vướng_mắc , khó_khăn như cơ_sở vật_chất một_số đơn_vị xuống_cấp , trang_thiết_bị kỹ_thuật cao còn thiếu và bác_sĩ chuyên_khoa sâu còn thiếu . Một_số trung_tâm y_tế huyện thiếu các thiết_bị y_tế kỹ_thuật cao như : siêu_âm màu , X - quang kỹ_thuật_số , máy xét_nghiệm sinh_hóa tự_động … nên không thu_hút được bệnh_nhân , nguồn thu của đơn_vị giảm . Thanh_toán bảo_hiểm_y_tế còn chậm , đặc_biệt là phần vượt trần , vượt quỹ khám_chữa bệnh bảo_hiểm_y_tế . Do_dịch COVID - 19 , trong giai_đoạn 2020 - 2021 , số_lượng người đến khám_chữa bệnh tại các cơ_sở y_tế công_lập giảm đáng_kể , dẫn đến các đơn_vị thiếu_hụt nguồn thu . Kinh_phí thiếu_hụt của hệ bệnh_viện trong năm 2022 là hơn 72 tỉ đồng . Tại_Bệnh_viện Đa_khoa tỉnh Gia_Lai , trong giai_đoạn giãn cách xã_hội do đại_dịch COVID - 19 bùng_phát , công_suất sử_dụng giường_bệnh giảm sâu , nguồn thu giảm mạnh . Vì_vậy , chênh_lệch thu chi của Bệnh_viện Đa_khoa tỉnh giai_đoạn này âm gần 67 tỉ đồng . Lương_thấp , chế_độ đãi_ngộ không hấp_dẫn nên từ đầu năm 2023 đến nay đã có gần 40 bác_sĩ , nhân_viên y_tế của bệnh_viện này bỏ việc , nghỉ_việc .",
