     "title": "Lý do phải giảm mỡ bụng",
     "author": "Kiều Vũ (T\/H)",
     "file_names": "89.txt",
     "file_texts": "Xem mỡ bụng thuộc loại nào Mỡ bụng có thể là lớp mỡ dưới da hoặc là lớp mỡ nội tạng. Mỡ nội tạng là lớp mỡ bao quanh các cơ quan nội tạng trong bụng, còn lớp mỡ dưới da là lớp mỡ nằm ngay dưới lớp da.\nTrong đó mỡ nội tạng là nguy hiểm nhất. Về lâu dài nó có thể gây ra mệt số bệnh nguy hiểm như bệnh tim mạch, huyết áp, tiểu đường.Để xác định mỡ bụng của bản thân thuộc loại mỡ nào thì chỉ cần véo vào\nbụng. Nếu đó là lớp mỡ dưới da thì sẽ cảm nhận được lớp mỡ này nằm ngay dưới da và có thể di chuyển nó cùng với da một cách dễ dàng. Nếu đó là lớp mỡ nội tạng thì rất khó có thể nhìn thấy bằng mắt\nthường.Sự hình thành của mỡ bụngCó nhiều nguyên nhân khác nhau dẫn đến sự hình thành mỡ bụng. Đáng chú ý ở đây là một người có thể có 1 hoặc nhiều nguyên nhân khác nhau gây ra mỡ bụng.Các lý do chính\nlà ngồi nhiều, lười vận động; do nội tiết tố; do di truyền; do dư thừa năng lượng. Trong đó, nguyên nhân chủ yếu hình thành mỡ bụng dưới là do dư thừa lượng calo trong cơ thể. Khi lượng calo nạp vào\ncơ thể cao hơn lượng calo tiêu hao sẽ dẫn đến tình trạng dư thừa năng lượng. Năng lượng này bị chuyển hóa thành mỡ tích trữ dưới da. Vùng da dễ tích lũy mỡ nhất chính là bụng dưới. Trung bình một ngày\nchỉ nên bổ sung khoảng 1.800 – 2.200 calo để hạn chế tình trạng dư thừa năng lượng.Tại sao phải giảm mỡ bụngLý do cần phải giảm mỡ bụng là vì sức khoẻ và thẩm mỹ. Béo bụng đặc biệt có hại, đã có những\nnghiên cứu cho thấy mối liên hệ chặt chẽ giữa béo bụng với các bệnh như đái tháo đường loại 2 và bệnh tim mạch. Bên cạnh đó béo bụng cũng có thể là một trong những nguyên nhân của gan nhiễm mỡ, máu\nnhiễm mỡ, rối loạn nội tiết tố cơ thể… Sở dĩ như vậy vì hàm lượng chất béo cao khiến quá trình chuyển hóa trong cơ thể rối loạn, kích thích lượng estrogen trong cơ thể sản sinh vượt mức.Khi bị béo\nbụng thường khiến cảm thấy nặng nề, mệt mỏi, đi lại, vận động khó khăn. Nhiều người khi rơi vào tình trạng này thì lại càng lười vận động và hệ luỵ của lười vận động sẽ khiến mỡ tích tụ nhiều hơn.",
     "token": "Xem_mỡ bụng_thuộc loại nào Mỡ_bụng có_thể là lớp mỡ dưới da hoặc là lớp mỡ nội tạng . Mỡ nội tạng là lớp mỡ bao quanh các cơ_quan nội tạng trong bụng , còn lớp mỡ dưới da là lớp mỡ nằm ngay dưới lớp da . Trong_đó_mỡ nội tạng là nguy_hiểm nhất . Về lâu_dài nó có_thể gây ra mệt số bệnh nguy_hiểm như bệnh tim_mạch , huyết_áp , tiểu_đường . Để_xác_định mỡ bụng của bản_thân thuộc loại mỡ nào thì chỉ cần véo vào bụng . Nếu đó là lớp mỡ dưới da thì sẽ cảm_nhận được lớp mỡ này nằm ngay dưới da và có_thể di_chuyển nó cùng với da một_cách dễ_dàng . Nếu đó là lớp mỡ nội tạng thì rất khó có_thể nhìn thấy bằng mắt thường . Sự_hình thành của mỡ_bụngCó nhiều nguyên_nhân khác nhau dẫn đến sự hình_thành mỡ bụng . Đáng chú_ý ở đây là một người có_thể có 1 hoặc nhiều nguyên_nhân khác nhau gây ra mỡ bụng . Các_lý do chính là ngồi nhiều , lười vận_động ; do nội_tiết_tố ; do di_truyền ; do dư_thừa năng_lượng . Trong đó , nguyên_nhân chủ_yếu hình_thành mỡ bụng dưới là do dư_thừa lượng calo trong cơ_thể . Khi_lượng calo_nạp vào cơ_thể cao hơn lượng calo tiêu_hao sẽ dẫn đến tình_trạng dư_thừa năng_lượng . Năng_lượng này bị chuyển hóa thành mỡ tích_trữ dưới da . Vùng_da dễ tích_lũy mỡ nhất chính là bụng dưới . Trung_bình một ngày chỉ nên bổ_sung khoảng 1.800 – 2.200 calo để hạn_chế tình_trạng dư_thừa năng_lượng . Tại_sao phải giảm mỡ bụngLý do cần phải giảm mỡ bụng là vì sức_khoẻ và thẩm_mỹ . Béo_bụng đặc_biệt có hại , đã có những nghiên_cứu cho thấy mối liên_hệ chặt_chẽ giữa béo bụng với các bệnh như đái_tháo_đường loại 2 và bệnh tim_mạch . Bên_cạnh đó béo bụng cũng có_thể là một trong những nguyên_nhân của gan nhiễm_mỡ , máu nhiễm mỡ , rối_loạn nội tiết tố cơ_thể … Sở_dĩ như vậy vì hàm_lượng chất_béo cao khiến quá_trình chuyển_hóa trong cơ_thể rối_loạn , kích_thích lượng estrogen trong cơ_thể sản_sinh vượt mức . Khi bị béo bụng thường khiến cảm_thấy nặng_nề , mệt_mỏi , đi_lại , vận_động khó_khăn . Nhiều người khi rơi vào tình_trạng này thì lại càng lười vận_động và hệ_luỵ của lười vận_động sẽ khiến mỡ tích_tụ nhiều hơn .",
