     "file_texts": "Giá vàng trong nước Diến biến giá vàng trong nước Diễn biến giá vàng thế giới Giá vàng thế giới tăng trong bối cảnh đồng USD giảm. Ghi nhận lúc 17h ngày 27.11, chỉ số US Dollar Index đo lường biến\nđộng của đồng bạc xanh với 6 đồng tiền chủ chốt ở ngưỡng 103,249 điểm (giảm 0,06%).Giá vàng tăng lên mức đỉnh cao nhất trong sáu tháng. Thông tin hỗ trợ giá vàng tăng là nhờ đồng USD yếu và đồn đoán\nrằng, Cục Dự trữ liên bang Mỹ (FED) đã hoàn thành lộ trình tăng lãi suất.Nhà phân tích kỹ thuật Wang Tao nhận định, giá vàng giao ngay có thể tăng trong phạm vi từ 2.026 - 2.032 USD\/ounce, vì đã vượt\nqua ngưỡng kháng cự 1.999 USD\/ounce.Ở chiều ngược lại, Mark Leibovit - chuyên gia tài chính, cho biết giá vàng có thể gặp rủi ro do tình trạng bán tháo khi nhu cầu huy động tiền mặt cho thị trường\nchứng khoán. Ông Leibovit cảnh báo giá vàng có thể gặp những bất lợi do đồng USD đang có dấu hiệu tăng trở lại.Ông Kyle Rodda - nhà phân tích thị trường tại chuyên trang tài chính Capital.com cho\nrằng, các số liệu kinh tế được công bố trong tuần này của Mỹ, bao gồm tốc độ tăng trưởng và lạm phát, sẽ quyết định liệu giá vàng có duy trì trên ngưỡng 2.000 USD\/ounce hay không.Tâm điểm chú ý của\ngiới đầu tư đang tập trung vào số liệu Tổng sản phẩm quốc nội (GDP) quý III của Mỹ dự kiến công bố vào ngày 29.11 (giờ địa phương), cùng chỉ số giá tiêu dùng cá nhân (PCE) vào một ngày sau đó.Các số\nliệu gần đây cho thấy dấu hiệu lạm phát chậm lại ở Mỹ. Diễn biến đó đã làm tăng kỳ vọng rằng FED có thể bắt đầu nới lỏng các chính sách tiền tệ sớm hơn dự kiến.Xem thêm các tin bài khác về giá vàng\ntrên Báo Lao Động tại đây...",
