     "Column1": 90,
     "subject": "Y Tế",
     "title": "4 loại trái cây tốt cho đường huyết, giúp giảm cân",
     "author": "HẠ MÂY (THEO ABOLUOWANG)",
     "file_names": "90.txt",
     "file_texts": "Quả táo Táo có nhiều chất xơ và chất phytochemical rất có lợi cho người mắc bệnh tiểu đường. Chất xơ giúp ổn định lượng đường trong máu, làm chậm quá trình hấp thụ đường và mang lại cảm giác no lâu\nhơn, giúp giảm cân.Ngoài ra, polyphenol trong táo có tác dụng chống oxy hóa và chống viêm, có thể ngăn ngừa và cải thiện các biến chứng do bệnh tiểu đường gây ra.Quả camLoại quả này rất giàu vitamin C\nvà chất xơ. Vitamin C có thể giúp tăng cường hệ thống miễn dịch và duy trì các mạch máu khỏe mạnh. Ngoài ra, cam có đặc tính chống oxy hóa giúp giảm viêm mãn tính và cải thiện quá trình xử lý và sử\ndụng lượng đường trong máu.Hàm lượng calo thấp và chất xơ cao của cam có thể khiến chúng trở thành một lựa chọn ăn nhẹ lành mạnh cho những người mắc bệnh tiểu đường, người muốn giảm cân.Quả việt\nquấtQuả việt quất rất giàu chất chống oxy hóa, chẳng hạn như anthocyanin và flavonoid, giúp giảm lượng đường trong máu, giảm cân, cải thiện độ nhạy insulin và giảm sự xuất hiện của các biến chứng tiểu\nđường.Ngoài ra, quả việt quất còn có đặc tính chống viêm, giúp giảm mức độ viêm mãn tính và cải thiện việc kiểm soát lượng đường trong máu.ChuốiChuối rất giàu kali và vitamin B6, rất cần thiết cho sức\nkhỏe tim mạch ở người mắc bệnh tiểu đường.Kali giúp duy trì chức năng tim và huyết áp bình thường, đồng thời hàm lượng calo thấp và chất xơ cao trong chuối giúp kiểm soát lượng đường trong máu và cân\nnặng.",
