     "Column1": 91,
     "subject": "Y Tế",
     "title": "Thời điểm ăn tối giúp kéo dài tuổi thọ",
     "author": "HẠ MÂY (THEO ABOLUOWANG)",
     "file_names": "91.txt",
     "file_texts": "Các nghiên cứu tại Mỹ đã chỉ ra rằng, ăn tối quá muộn có thể làm tăng đáng kể tỉ lệ mắc sỏi đường tiết niệu. Điều này là do thời kỳ bài tiết canxi cao nhất trong cơ thể con người là từ 4 đến 5 giờ sau\nbữa ăn.Nếu chúng ta ăn tối quá muộn hoặc thường ăn đồ ăn nhẹ vào đêm khuya thì khi thời gian cao điểm để bài tiết canxi, nước tiểu không kịp đào thải ra ngoài dẫn đến trong nước tiểu có một lượng lớn\ncanxi, canxi sẽ lắng đọng và lâu ngày sẽ hình thành sỏi.Sỏi đường tiết niệu bao gồm sỏi thận, sỏi niệu quản, sỏi bàng quang, sỏi niệu đạo... Ngoài việc gây ra các triệu chứng như đau lưng, đau bụng,\ntiểu ra máu, sỏi đường tiết niệu còn có thể gây tắc nghẽn đường tiết niệu, nhiễm trùng đường tiết niệu, thận ứ nước… ảnh hưởng đến chức năng thận.Theo nghiên cứu, những người có lượng nước tiểu hằng\nngày dưới 500 ml có nguy cơ hình thành sỏi. Vì vậy, đảm bảo bài tiết nước tiểu là một trong những biện pháp cơ bản nhất để phòng ngừa và điều trị sỏi đường tiết niệu.Các chuyên gia liên quan cho rằng,\nthời điểm tốt nhất cho bữa tối là khoảng 18h và chúng ta nên cố gắng ăn càng ít đồ ăn nhẹ vào đêm khuya càng tốt. Uống nhiều nước đun sôi là cách phòng ngừa và điều trị sỏi đường tiết niệu hiệu quả\nnhất. Người bình thường mỗi ngày nên uống khoảng 1.500ml nước, nước uống nên chia vào nhiều thời điểm khác nhau trong ngày.",
     "token": "Các_nghiên_cứu tại Mỹ đã chỉ ra rằng , ăn tối quá muộn có_thể làm tăng đáng_kể tỉ_lệ mắc sỏi đường tiết_niệu . Điều này là do thời_kỳ bài_tiết canxi cao nhất trong cơ_thể con_người là từ 4 đến 5 giờ sau bữa ăn . Nếu_chúng ta ăn tối quá muộn hoặc thường ăn đồ ăn nhẹ vào đêm khuya thì khi thời_gian cao_điểm để bài_tiết canxi , nước_tiểu không kịp đào_thải ra ngoài dẫn đến trong nước_tiểu có một lượng lớn canxi , canxi sẽ lắng_đọng và lâu ngày sẽ hình_thành sỏi . Sỏi_đường tiết_niệu bao_gồm sỏi thận , sỏi niệu_quản , sỏi bàng_quang , sỏi niệu_đạo ... Ngoài_việc gây ra các triệu_chứng như đau lưng , đau bụng , tiểu ra máu , sỏi_đường tiết_niệu còn có_thể gây tắc_nghẽn đường tiết_niệu , nhiễm_trùng đường tiết_niệu , thận ứ nước … ảnh_hưởng đến chức_năng thận . Theo nghiên_cứu , những người có lượng nước_tiểu hằng ngày dưới 500 ml có nguy_cơ hình_thành sỏi . Vì_vậy , đảm_bảo bài_tiết nước_tiểu là một trong những biện_pháp cơ_bản nhất để phòng_ngừa và điều_trị sỏi_đường tiết_niệu . Các chuyên_gia liên_quan cho rằng , thời_điểm tốt nhất cho bữa tối là khoảng 18h và chúng_ta nên cố_gắng ăn_càng ít đồ_ăn nhẹ vào đêm khuya càng tốt . Uống_nhiều_nước đun_sôi là cách phòng_ngừa và điều_trị sỏi đường tiết_niệu hiệu_quả nhất . Người_bình thường mỗi ngày nên uống khoảng 1.500 ml nước , nước uống nên chia vào nhiều thời_điểm khác nhau trong ngày .",
