     "file_names": "92.txt",
     "file_texts": "Nghệ Thành phần chính của nghệ có chứa các hoạt chất tự nhiên giúp giảm cân rất tốt, đặc biệt là Curcumin và Phytochemical. Curcumin còn là một hợp chất chống ôxy hóa, chống viêm, được chứng minh là có\ntác dụng giảm mỡ bụng.Các dưỡng chất đa dạng có trong củ nghệ sẽ là chất xúc tác cho cơ thể để có thể tăng cường trao đổi và chuyển hóa các chất tốt hơn, giúp cơ thể đốt cháy một lượng calo đáng kể,\ntừ đó loại bỏ được lượng mỡ dư thừa.GừngKhông chỉ là một loại gia vị quen thuộc, chữa nhiều bệnh như thấp khớp, đau nhức, sưng tấy, huyết áp... gừng còn giúp cơ thể giữ ấm, hỗ trợ giảm cân hiệu quả.\nSở dĩ, gừng tươi có tác dụng đánh bay mỡ bụng là do gừng có tính nóng, nếu tiếp xúc với da sẽ sinh nhiệt giúp đốt cháy nhanh chóng mỡ thừa tích tụ ở vùng bụng.Hai thành phần có trong gừng là Gingerol\nvà Shogaol sẽ làm tăng độ PH trong dạ dày, hỗ trợ hệ tiêu hóa hoạt động tốt hơn, ức chế quá trình tích tụ mỡ, giúp quá trình phân hủy chất béo diễn ra nhanh hơn, ngăn cản chất béo tự nhiên phát triển.",
     "token": "Nghệ_Thành phần chính của nghệ có chứa các hoạt_chất tự_nhiên giúp giảm cân rất tốt , đặc_biệt là Curcumin và Phytochemical . Curcumin còn là một hợp_chất chống ôxy hóa , chống viêm , được chứng_minh là có tác_dụng giảm mỡ bụng . Các dưỡng_chất đa_dạng có trong củ_nghệ sẽ là chất xúc_tác cho cơ_thể để có_thể tăng_cường trao_đổi và chuyển_hóa các chất tốt hơn , giúp cơ_thể đốt cháy một lượng calo đáng_kể , từ đó loại_bỏ được lượng mỡ dư_thừa . GừngKhông chỉ là một loại gia_vị quen_thuộc , chữa nhiều bệnh như thấp_khớp , đau nhức , sưng tấy , huyết_áp ... gừng còn giúp cơ_thể giữ ấm , hỗ_trợ giảm cân hiệu_quả . Sở_dĩ , gừng_tươi có tác_dụng đánh bay mỡ bụng là do gừng có tính nóng , nếu tiếp_xúc với da sẽ sinh_nhiệt giúp đốt cháy nhanh_chóng mỡ_thừa tích_tụ ở vùng bụng . Hai_thành phần có trong gừng là Gingerol và Shogaol sẽ làm tăng độ_PH trong dạ_dày , hỗ_trợ hệ_tiêu hóa hoạt_động tốt hơn , ức_chế quá trình_tích tụ_mỡ , giúp quá_trình phân_hủy chất_béo diễn ra nhanh hơn , ngăn_cản chất_béo tự_nhiên phát_triển .",
