     "file_texts": "Luyện tập cường độ cao ngắt quãng (HIIT)HIIT bao gồm các đợt tập luyện cường độ cao trong thời gian ngắn, sau đó là thời gian nghỉ ngơi ngắn. Phương pháp tập luyện có thể đốt cháy nhiều calo hơn trong\nthời gian ngắn hơn, lí tưởng cho những người có lịch trình bận rộn.Bắt đầu bằng bài tập khởi động, sau đó xen kẽ giữa các bài tập cường độ cao và nghỉ ngơi. Đặt mục tiêu tập HIIT ít nhất 20 phút, 3-4\nlần\/tuần. Tập luyện với nhiều bài tập khác nhau như bật nhảy, burpee (bài tập đốt cháy mỡ thừa trên toàn bộ cơ thể mà không cần sử dụng đến bất kì dụng cụ chuyên dụng) và chạy nước rút.Kiểm soát khẩu\nphần ănKiểm soát khẩu phần ăn có thể ngăn chặn lượng calo nạp vào quá mức. Có nghĩa là cung cấp đủ lượng thức ăn mà cơ thể bạn cần, tránh tình trạng ăn quá nhiều. Bạn có thể sử dụng đĩa nhỏ hơn để\nđánh lừa tâm trí rằng bạn đang ăn nhiều hơn. Đồng thời, lắng nghe tín hiệu đói và no của cơ thể.Uống đủ nướcUống đủ nước là điều quan trọng để giảm cân. Nước có thể giúp kiểm soát cơn đói, hỗ trợ quá\ntrình trao đổi chất và thải độc tố.Theo đó, uống ít nhất 8 ly nước mỗi ngày. Song song đó, bắt đầu ngày mới với 1 ly nước để khởi động quá trình trao đổi chất. Thay thế đồ uống có đường bằng nước lọc\nhoặc trà thảo mộc.Ưu tiên proteinBổ sung protein trong chế độ ăn uống của bạn sẽ giúp kiểm soát cảm giác thèm ăn, tăng cường trao đổi chất và duy trì khối lượng cơ bắp trong quá trình giảm cân.Bạn có\nthể lựa chọn các nguồn protein nạc như thịt gà, cá, đậu phụ và các loại đậu trong bữa ăn. Ngoài ra, ăn đồ ăn nhẹ giàu protein để giữ cho bạn no giữa các bữa ăn.",
     "token": "Luyện_tập cường_độ cao ngắt_quãng ( HIIT ) HIIT bao_gồm các đợt tập_luyện cường_độ cao trong thời_gian ngắn , sau đó là thời_gian nghỉ_ngơi ngắn . Phương_pháp tập_luyện có_thể đốt cháy nhiều calo hơn trong thời_gian ngắn hơn , lí_tưởng cho những người có lịch_trình bận_rộn . Bắt_đầu bằng bài tập khởi_động , sau đó xen_kẽ giữa các bài_tập cường_độ cao và nghỉ_ngơi . Đặt_mục tiêu_tập HIIT ít_nhất 20 phút , 3 - 4 lần \/ tuần . Tập_luyện với nhiều bài tập khác nhau như bật_nhảy , burpee ( bài tập đốt cháy mỡ thừa trên toàn_bộ cơ_thể mà không cần sử_dụng đến bất_kì dụng_cụ chuyên_dụng ) và chạy nước rút . Kiểm_soát khẩu_phần ănKiểm soát_khẩu phần ăn có_thể ngăn_chặn lượng calo_nạp vào quá_mức . Có_nghĩa là cung_cấp đủ lượng thức_ăn mà cơ_thể bạn cần , tránh tình_trạng ăn quá nhiều . Bạn_có_thể sử_dụng đĩa nhỏ hơn để đánh_lừa tâm_trí rằng bạn đang ăn nhiều hơn . Đồng_thời , lắng_nghe tín_hiệu đói và no của cơ_thể . Uống_đủ nướcUống đủ nước là điều quan_trọng để giảm cân . Nước_có_thể giúp kiểm_soát cơn đói , hỗ_trợ quá_trình trao_đổi chất và thải độc_tố . Theo_đó , uống ít_nhất 8 ly nước mỗi ngày . Song_song đó , bắt_đầu ngày_mới với 1 ly nước để khởi_động quá_trình trao_đổi chất . Thay_thế đồ uống có đường bằng nước_lọc hoặc trà_thảo mộc . Ưu_tiên proteinBổ sung protein trong chế_độ ăn_uống của bạn sẽ giúp kiểm_soát cảm_giác thèm ăn , tăng_cường trao_đổi chất và duy_trì khối_lượng cơ_bắp trong quá_trình giảm cân . Bạn_có_thể lựa_chọn các nguồn protein nạc như thịt gà , cá , đậu phụ và các loại đậu trong bữa ăn . Ngoài_ra , ăn đồ ăn nhẹ giàu protein để giữ cho bạn no giữa các bữa ăn .",
