     "file_texts": "Ghi nhớ trước khi ănLoại bỏ đồ uống có đường, thay vào đó nên bổ sung nhiều trái cây, rau, ngũ cốc nguyên hạt vào chế độ ăn uống.Tiêu thụ protein có thể giúp cải thiện lượng đường trong máu và làm\nchậm quá trình tiêu hóa, giúp bạn cảm thấy no, từ đó hỗ trợ giảm cân.Tăng cường tiêu thụ chất xơ có thể làm chậm quá trình hấp thụ đường và chất béo, đồng thời ngăn ngừa lượng đường trong máu tăng đột\nbiến.Ăn uống đều đặn và ghi nhật ký ăn uống giúp theo dõi lượng calo và khẩu phần ăn của bạn.Kiểm tra chỉ số đường huyết (GI) của thực phẩm: Chỉ số đường huyết giúp bạn ước tính về tốc độ phân hủy\ncarbohydrate trong quá trình tiêu hóa. Một nghiên cứu cho thấy chế độ ăn có chỉ số GI thấp có thể giúp giảm lượng đường huyết lúc đói, điều này có thể giúp ích cho những người mắc bệnh tiểu đường hoặc\ntiền tiểu đường.Những người mắc bệnh tiểu đường uống rượu, đặc biệt là những người dùng insulin hoặc thuốc insulin, có thể dễ bị hạ đường huyết hơn. Do đó, bạn nên hạn chế uống rượu ở mức 1 ly mỗi\nngày.Giảm chất béo không lành mạnh và bổ sung chất béo lành mạnh: Theo Hiệp hội Tiểu đường Hoa Kỳ, việc giảm tiêu thụ chất béo bão hòa và chất béo chuyển hóa, đồng thời tăng lượng axit béo omega-3 có\nthể cải thiện mức cholesterol và chất béo ở bệnh nhân tiểu đường.Tập thể dục thường xuyên giúp giảm lượng đường trong máu và tăng nhạy cảm insulin, giúp giảm được những biến chứng tăng đường huyết cho\nbệnh nhân.Chế độ ăn uống ảnh hưởng rất nhiều đến việc người tiểu đường muốn giảm cân. Ảnh đồ họa: Hàn Lâm.Thực phẩm nên ănRau: Bông cải xanh, cà rốt, rau xanh, ớt và cà chua.Tinh bột: Khoai tây, ngô\nvà đậu xanh.Trái cây: Cam, dưa, quả mọng, nho, táo và chuối.Hạt, lúa mì, quinoa, lúa mạch, yến mạch và bột ngô.Chất đạm: cá, trứng, thịt gà hoặc gà tây bỏ da, đậu khô, đậu xanh, đậu Hà Lan tách vỏ và\nđậu phụ.Sản phẩm bơ sữa: sữa không béo hoặc ít béo hoặc sữa, sữa chua và phô mai không chứa lactose.Chất béo lành mạnh: Dầu cải và dầu ô liu, quả bơ, các loại hạt và các loại cá như cá hồi, cá ngừ và\ncá thu.Thực phẩm nên tránhThực phẩm chiên, các thực phẩm khác có nhiều chất béo bão hòa và chất béo chuyển hóa.Thực phẩm giàu natri như giăm bông, pizza, dưa chua và nước sốt.Đường bổ sung như kẹo, đồ\nnướng, kẹo và kem.Đồ uống có thêm đường như soda, nước trái cây, đồ uống dành cho thể thao.Rượu, bia.Giảm thực phẩm nhiều muối.",
     "token": "Ghi_nhớ trước khi ănLoại_bỏ đồ uống có đường , thay vào đó nên bổ_sung nhiều trái_cây , rau , ngũ_cốc nguyên_hạt vào chế_độ ăn_uống . Tiêu_thụ protein có_thể giúp cải_thiện lượng đường trong máu và làm chậm quá_trình tiêu_hóa , giúp bạn cảm_thấy no , từ đó hỗ_trợ giảm cân . Tăng_cường tiêu_thụ chất_xơ có_thể làm chậm quá_trình hấp_thụ đường và chất_béo , đồng_thời ngăn_ngừa lượng đường trong máu tăng đột_biến . Ăn_uống đều_đặn và ghi nhật_ký ăn_uống giúp theo_dõi lượng calo và khẩu_phần ăn của bạn . Kiểm_tra chỉ số đường_huyết ( GI ) của thực_phẩm : Chỉ_số đường huyết giúp bạn ước_tính về tốc_độ phân_hủy_carbohydrate trong quá_trình tiêu_hóa . Một_nghiên_cứu cho thấy chế_độ ăn_có chỉ số GI thấp có_thể giúp giảm lượng đường_huyết lúc đói , điều này có_thể giúp_ích cho những người mắc bệnh tiểu_đường hoặc tiền tiểu_đường . Những_người mắc bệnh tiểu_đường uống rượu , đặc_biệt là những người dùng insulin hoặc thuốc_insulin , có_thể dễ bị hạ đường_huyết hơn . Do_đó , bạn nên hạn_chế uống rượu ở mức 1 ly mỗi ngày . Giảm chất béo không lành_mạnh và bổ_sung chất_béo lành_mạnh : Theo_Hiệp hội Tiểu_đường Hoa_Kỳ , việc giảm tiêu_thụ chất_béo bão hòa và chất_béo chuyển_hóa , đồng_thời tăng lượng axit béo omega - 3 có_thể cải_thiện mức cholesterol và chất_béo ở bệnh_nhân tiểu_đường . Tập_thể_dục thường_xuyên giúp giảm lượng đường trong máu và tăng nhạy cảm insulin , giúp giảm được những biến_chứng tăng đường_huyết cho bệnh_nhân . Chế_độ ăn_uống ảnh_hưởng rất nhiều đến việc người tiểu_đường muốn giảm cân . Ảnh_đồ họa : Hàn_Lâm . Thực_phẩm nên ănRau : Bông_cải xanh , cà_rốt , rau xanh , ớt và cà_chua . Tinh_bột : Khoai tây , ngô và đậu xanh . Trái_cây : Cam , dưa , quả mọng , nho , táo và chuối . Hạt , lúa_mì , quinoa , lúa mạch , yến mạch và bột ngô . Chất_đạm : cá , trứng , thịt gà hoặc gà_tây bỏ da , đậu khô , đậu xanh , đậu Hà_Lan tách vỏ và đậu phụ . Sản_phẩm bơ sữa : sữa không béo hoặc ít béo hoặc sữa , sữa chua và phô mai không chứa lactose . Chất_béo lành_mạnh : Dầu_cải và dầu ô_liu , quả_bơ , các loại hạt và các loại cá như cá_hồi , cá_ngừ và cá thu . Thực_phẩm nên tránhThực_phẩm chiên , các thực_phẩm khác có nhiều chất_béo bão_hòa và chất_béo chuyển_hóa . Thực_phẩm giàu natri như giăm bông , pizza , dưa chua và nước sốt . Đường_bổ_sung như kẹo , đồ_nướng , kẹo và kem . Đồ_uống có thêm đường như soda , nước trái_cây , đồ uống dành cho thể_thao . Rượu_,_bia . Giảm_thực_phẩm nhiều muối .",
