     "file_names": "95.txt",
     "file_texts": "Đánh răng 2 lần mỗi ngàyGiữ thói quen đánh răng hai lần mỗi ngày vào buổi sáng và trước khi đi ngủ sẽ giúp loại bỏ thức ăn thừa, mảng bám, vi khuẩn giúp răng trắng sáng.Đối với hàm răng sâu, hoặc gặp\nnhiều vấn đề về sức khoẻ răng miệng, hãy tham khảo ý kiến của các bác sĩ chuyên khoa để điều chỉnh việc đánh răng hằng ngày cho phù hợp.Ăn các loại thực phẩm có nhiều chất xơĐể tốt cho sức khoẻ răng\nmiệng, nên chọn ăn các loại thực phẩm giàu chất xơ như rau cải, cải xanh, cam, chanh... Những thực phẩm giòn và nhiều chất xơ này hoạt động như chất tẩy rửa tự nhiên, làm sạch bề mặt răng một cách\nhiệu quả.Việc nhai những thực phẩm này cũng kích thích sản xuất nước bọt, một thành phần quan trọng trong việc duy trì sức khỏe răng miệng. Nước bọt không chỉ hỗ trợ quá trình làm sạch cơ học mà còn\nđóng vai trò chính trong việc trung hòa axit trong miệng, góp phần mang lại môi trường răng miệng khỏe mạnh hơn.Ăn nhiều trái câyMột thực đơn ăn uống đa dạng, nhiều trái cây, hoa quả sẽ giúp răng\nchống lại các vết bẩn. Những loại quả tốt cho răng miệng được khuyên thường xuyên sử dụng là dứa, đu đủ và dâu tây.Những loại trái cây này có chứa enzym hoặc axit nhẹ giúp đánh tan vết ố, khiến răng\ntrắng sáng hơn.Sử dụng các sản phẩm làm sạch răng có chứa than hoạt tínhSử dụng các sản phẩm chăm sóc răng miệng có chứa than hoạt tính có thể giúp loại bỏ vết ố trên răng do thức ăn để lại. Đặc tính\nthấm hút của than củi có thể giúp đánh bay vết bẩn trên bề mặt răng giúp nụ cười sáng hơn.Để có hàm răng chắc khoẻ, trắng sáng... hãy chú ý đến việc khám răng định kỳ. Việc khám răng thường xuyên sẽ\ngiúp bạn nhanh chóng phát hiện các vấn đề về sức khoẻ răng miệng, cách điều trị hợp lý và có một hàm răng sáng khoẻ.",
     "token": "Đánh_răng 2 lần mỗi ngàyGiữ thói_quen đánh răng hai lần mỗi ngày vào buổi sáng và trước khi đi ngủ sẽ giúp loại bỏ thức ăn thừa , mảng bám , vi_khuẩn giúp răng trắng sáng . Đối_với hàm_răng sâu , hoặc gặp nhiều vấn_đề về sức_khoẻ răng miệng , hãy tham_khảo ý_kiến của các bác_sĩ chuyên_khoa để điều_chỉnh việc đánh răng hằng ngày cho phù_hợp . Ăn_các loại thực_phẩm có nhiều chất xơĐể tốt cho sức_khoẻ răng miệng , nên chọn ăn các loại thực_phẩm giàu chất_xơ như rau_cải , cải_xanh , cam , chanh ... Những_thực phẩm_giòn và nhiều chất_xơ này hoạt_động như chất tẩy_rửa tự_nhiên , làm_sạch_bề_mặt răng một_cách hiệu_quả . Việc_nhai những thực_phẩm này cũng kích_thích sản_xuất nước_bọt , một thành_phần quan_trọng trong việc duy_trì sức_khỏe răng miệng . Nước_bọt không_chỉ hỗ_trợ quá_trình làm sạch cơ_học mà_còn đóng vai_trò chính trong việc trung_hòa axit trong miệng , góp_phần mang lại môi_trường răng miệng khỏe_mạnh hơn . Ăn_nhiều trái câyMột thực_đơn ăn_uống đa_dạng , nhiều trái_cây , hoa_quả sẽ giúp răng chống lại các vết bẩn . Những_loại quả tốt cho răng miệng được khuyên thường_xuyên sử_dụng là dứa , đu_đủ và dâu_tây . Những_loại trái_cây này có chứa enzym hoặc axit nhẹ giúp đánh tan vết ố , khiến răng trắng sáng hơn . Sử_dụng các sản_phẩm làm sạch răng có chứa than_hoạt tínhSử_dụng các sản_phẩm chăm_sóc răng miệng có chứa than hoạt_tính có_thể giúp loại_bỏ vết ố trên răng do thức_ăn để lại . Đặc_tính thấm hút của than củi có_thể giúp đánh bay vết bẩn trên bề_mặt răng_giúp nụ cười sáng hơn . Để có hàm_răng chắc_khoẻ , trắng_sáng ... hãy chú_ý đến việc khám_răng định_kỳ . Việc_khám răng thường_xuyên sẽ giúp bạn nhanh_chóng phát_hiện các vấn_đề về sức_khoẻ răng miệng , cách điều_trị hợp_lý và có một hàm_răng sáng_khoẻ .",
