     "title": "4 loại thực phẩm không tốt cho người cao huyết áp, axit uric cao",
     "author": "HẠ MÂY (THEO ABOLUOWANG)",
     "file_names": "97.txt",
     "file_texts": "Thức ăn nhiều muối Bệnh nhân cao huyết áp, người axit uric cao nên kiểm soát lượng muối ăn vào mỗi ngày, không ăn đồ mặn.Bởi muối có thành phần chính là natri với tính chất hút nước. Khi thẩm thấu vào\nthành của động mạch, natri sẽ làm cho động mạch bị thu hẹp gây co mạch dẫn đến áp suất tăng, từ đó làm tăng huyết áp và không tốt cho người axit uric cao.Rượu, biaUống quá nhiều rượu, bia dễ dẫn đến\nnhịp tim tăng nhanh, co mạch, huyết áp tăng đột ngột và cũng có thể dễ dàng đẩy nhanh các bệnh động mạch.Đồng thời, rượu và bia cũng rất giàu purin không tốt cho sức khoẻ người có nồng độ axit uric\ncao.Thực phẩm giàu chất béoTrong cuộc sống, chúng ta nên cố gắng tránh ăn quá nhiều thực phẩm có hàm lượng chất béo cao, dễ bị béo phì như thịt mỡ, nội tạng động vật... Những thực phẩm như vậy không\ncó lợi cho quá trình trao đổi chất của con người, dẫn đến béo phì quá mức, gây ra huyết áp cao hoặc làm tăng axit uric.Thực phẩm có hàm lượng cholesterol caoNhững người đã bị huyết áp cao và axit uric\ncao nên ăn ít thực phẩm có hàm lượng cholesterol cao như nội tạng động vật, thịt chế biến sẵn, đồ ăn nhanh...Nếu cholesterol quá cao dễ gây tắc nghẽn mạch máu, gây huyết khối não, bệnh tim mạch vành,\nkhông có lợi cho việc duy trì sự ổn định huyết áp.",
     "token": "Thức_ăn nhiều muối Bệnh_nhân cao huyết_áp , người axit uric cao nên kiểm_soát lượng muối ăn vào mỗi ngày , không ăn đồ mặn . Bởi muối có thành_phần chính là natri với tính_chất hút_nước . Khi thẩm_thấu vào_thành của động_mạch , natri sẽ làm cho động_mạch bị thu_hẹp gây co_mạch dẫn đến áp_suất tăng , từ đó làm tăng huyết_áp và không tốt cho người axit uric cao . Rượu , biaUống quá nhiều rượu , bia dễ dẫn đến nhịp tim tăng nhanh , co_mạch , huyết_áp tăng đột_ngột và cũng có_thể dễ_dàng đẩy nhanh các bệnh động_mạch . Đồng_thời , rượu và bia cũng rất giàu purin không tốt cho sức_khoẻ người có nồng_độ axit uric cao . Thực_phẩm giàu chất_béoTrong cuộc_sống , chúng_ta nên cố_gắng tránh_ăn quá nhiều thực_phẩm có hàm_lượng chất_béo cao , dễ bị béo phì như thịt mỡ , nội tạng động_vật ... Những_thực_phẩm như_vậy không có lợi cho quá_trình trao_đổi chất của con_người , dẫn đến béo phì quá mức , gây ra huyết_áp cao hoặc làm tăng axit uric . Thực_phẩm có hàm_lượng cholesterol_caoNhững người đã bị huyết_áp cao và axit uric cao nên ăn ít thực_phẩm có hàm_lượng cholesterol cao như nội tạng động_vật , thịt chế_biến sẵn , đồ_ăn nhanh ... Nếu_cholesterol quá cao dễ gây tắc_nghẽn mạch_máu , gây huyết khối não , bệnh tim_mạch_vành , không có lợi cho việc duy_trì sự ổn_định huyết_áp .",
