     "title": "Thói quen cắn móng tay và những tác hại cần lưu ý",
     "author": "Tuấn Đạt (Theo Healthline)",
     "file_names": "98.txt",
     "file_texts": "Theo các chuyên gia tâm lý, thói quen cắn móng tay, mặc dù có vẻ như một thói quen vô hại, nhưng thực tế lại có thể ẩn chứa một vài triệu chứng tâm lý rất đáng lưu ý.Đây là một thói quen của nhiều\nngười nhưng việc cắn móng tay cũng thể hiện sự căng thẳng, lo âu hay thậm chí là một số biểu hiện của những triệu chứng tâm lý nặng hơn.Một trong những triệu chứng tâm lý của thói quen cắn móng tay\nchính là mức độ lo âu và căng thẳng tăng cao. Với nhiều người, thường xuyên cắn móng tay có thể là một cách để giảm bớt cảm giác stress.Mặc dù điều này có thể mang lại sự thư giãn ngắn hạn nhưng nó\nkhông giải quyết được nguyên nhân gốc rễ của sự việc, vẫn có thể bị cuốn vào một vòng luẩn quẩn của căng thẳng.Các chuyên gia tâm lý cũng cho rằng, thói quen cắn móng tay thường xuyên cũng thể hiện về\nsự thiếu tự tin, ngại tiếp xúc với người lạ hay cởi mở ở trong xã hội. Điều này cũng dẫn đến việc xa lánh mọi người xung quanh, không có nhu cầu giao tiếp với bất cứ ai và hoàn toàn hài lòng với cuộc\nsống chỉ có một mình.Việc quen cắn móng tay rất có thể là dấu hiệu của chứng rối loạn lo âu tự kỷ (OCD) hay rối loạn ăn uống. Vì thế, hãy cố gắng từ bỏ thói quen không tốt này cũng như điều chỉnh lối\nsống sinh hoạt, giảm tránh sự căng thẳng bằng việc giữ một tinh thần lạc quang, tập luyện thể thao và có một chế độ ăn uống thật lành mạnh.",
     "token": "Theo_các chuyên_gia tâm_lý , thói_quen cắn móng tay , mặc_dù có_vẻ như một thói_quen vô_hại , nhưng thực_tế lại có_thể ẩn_chứa một_vài triệu_chứng tâm_lý rất đáng lưu_ý . Đây_là một thói_quen của nhiều người nhưng việc cắn móng tay cũng thể_hiện sự căng_thẳng , lo_âu hay thậm_chí là một_số biểu_hiện của những triệu_chứng tâm_lý nặng hơn . Một trong những triệu_chứng tâm_lý của thói_quen cắn móng tay chính là mức_độ lo_âu và căng_thẳng tăng cao . Với_nhiều người , thường_xuyên cắn móng tay có_thể là một_cách để giảm bớt cảm_giác stress . Mặc_dù điều này có_thể mang lại sự thư_giãn ngắn_hạn nhưng nó không giải_quyết được nguyên_nhân gốc rễ của sự_việc , vẫn có_thể bị cuốn vào một vòng luẩn_quẩn của căng_thẳng . Các_chuyên_gia tâm_lý cũng cho rằng , thói_quen cắn móng tay thường_xuyên cũng thể_hiện về sự thiếu tự_tin , ngại tiếp_xúc với người lạ hay cởi_mở ở trong xã_hội . Điều này cũng dẫn đến việc xa_lánh mọi người xung_quanh , không có nhu_cầu giao_tiếp với bất_cứ ai và hoàn_toàn hài_lòng với cuộc_sống chỉ có một_mình . Việc_quen cắn móng tay rất có_thể là dấu_hiệu của chứng_rối loạn lo_âu tự_kỷ ( OCD ) hay rối_loạn ăn_uống . Vì_thế , hãy cố_gắng từ_bỏ thói_quen không tốt này cũng như điều_chỉnh lối sống sinh_hoạt , giảm tránh sự căng_thẳng bằng việc giữ một tinh_thần lạc_quang , tập_luyện thể_thao và có một chế_độ ăn_uống thật lành_mạnh .",
